INSERT INTO `movies` VALUES (11,'Star Wars: Episode IV - A New Hope','undefined','Princess Leia is captured and held hostage by the evil Imperial forces in their effort to take over the galactic Empire. Venturesome Luke Skywalker and dashing captain Han Solo team together with the loveable robot duo R2-D2 and C-3PO to rescue the beautiful princess and restore peace and justice in the Empire.',9.774295,'/tvSlBzAdRE29bZe5yYWrJ2ds137.jpg','undefined','1977-05-25'),(12,'Finding Nemo','undefined','A tale which follows the comedic and eventful journeys of two fish, the fretful Marlin and his young son Nemo, who are separated from each other in the Great Barrier Reef when Nemo is unexpectedly taken from his home and thrust into a fish tank in a dentist\'s office overlooking Sydney Harbor. Buoyed by the companionship of a friendly but forgetful fish named Dory, the overly cautious Marlin embarks on a dangerous trek and finds himself the unlikely hero of an epic journey to rescue his son.',4.211909,'/zjqInUwldOBa0q07fOyohYCWxWX.jpg','undefined','2003-05-30'),(13,'Forrest Gump','undefined','A man with a low IQ has accomplished great things in his life and been present during significant historic events - in each case, far exceeding what anyone imagined he could do. Yet, despite all the things he has attained, his one true love eludes him. \'Forrest Gump\' is the story of a man who rose above his challenges, and who proved that determination, courage, and love are more important than ability.',3.347765,'/z4ROnCrL77ZMzT0MsNXY5j25wS2.jpg','undefined','1994-06-22'),(27,'9 Songs','undefined','Matt, a young glaciologist, soars across the vast, silent, icebound immensities of the South Pole as he recalls his love affair with Lisa. They meet at a mobbed rock concert in a vast music hall - London\'s Brixton Academy. They are in bed at night\'s end. Together, over a period of several months, they pursue a mutual sexual passion whose inevitable stages unfold in counterpoint to nine live-concert songs.',3.022951,'/bvGyYmmnQG5NPP7m2nuLhaiC8LH.jpg','undefined','2004-07-16'),(33,'Unforgiven','undefined','William Munny is a retired, once-ruthless killer turned gentle widower and hog farmer. To help support his two motherless children, he accepts one last bounty-hunter mission to find the men who brutalized a prostitute. Joined by his former partner and a cocky greenhorn, he takes on a corrupt sheriff.',3.108126,'/km6qw4qUkHQRN5y2U1juM1WkBFh.jpg','undefined','1992-08-07'),(120,'The Lord of the Rings: The Fellowship of the Ring','undefined','Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.',6.850626,'/bxVxZb5O9OxCO0oRUNdCnpy9NST.jpg','undefined','2001-12-19'),(137,'Groundhog Day','undefined','A narcissistic TV weatherman, along with his attractive-but-distant producer and mawkish cameraman, is sent to report on Groundhog Day in the small town of Punxsutawney, where he finds himself repeating the same day over and over.',2.90396,'/vXjVd0Vu0MXRZnga7wEnHIIhO5B.jpg','undefined','1993-02-11'),(155,'The Dark Knight','undefined','Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.',6.72019,'/1hRoyzDtpgMU7Dz4JF22RANzQO7.jpg','undefined','2008-07-18'),(197,'Braveheart','undefined','Enraged at the slaughter of Murron, his new bride and childhood love, legendary Scottish warrior William Wallace slays a platoon of the local English lord\'s soldiers. This leads the village to revolt and, eventually, the entire country to rise up against English rule.',3.285953,'/2qAgGeYdLjelOEqjW9FYvPHpplC.jpg','undefined','1995-05-24'),(272,'Batman Begins','undefined','Driven by tragedy, billionaire Bruce Wayne dedicates his life to uncovering and defeating the corruption that plagues his home, Gotham City.  Unable to work within the system, he instead creates a new identity, a symbol of fear for the criminal underworld - The Batman.',6.918635,'/mYsoCOq82b08juHGxd3WnotiCAh.jpg','undefined','2005-06-15'),(278,'The Shawshank Redemption','undefined','Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.',5.231344,'/9O7gLzmreU0nGkIB6K3BsJbzvNv.jpg','undefined','1994-09-14'),(296,'Terminator 3: Rise of the Machines','undefined','It\'s been 10 years since John Connor saved Earth from Judgment Day, and he\'s now living under the radar, steering clear of using anything Skynet can trace. That is, until he encounters T-X, a robotic assassin ordered to finish what T-1000 started. Good thing Connor\'s former nemesis, the Terminator, is back to aid the now-adult Connor … just like he promised.',8.868313,'/lz4xYdF1n09lyiCfZWtWT44SZiG.jpg','undefined','2003-06-30'),(335,'Once Upon a Time in the West','undefined','This classic western masterpiece is an epic film about a widow whose land and life are in danger as the railroad is getting closer and closer to taking them over. A mysterious harmonica player joins forces with a desperado to protect the woman and her land.',2.580882,'/rVAHRtAMhV8QVXQMQ8NxNbZXCDp.jpg','undefined','1968-12-21'),(348,'Alien','undefined','During its return to the earth, commercial spaceship Nostromo intercepts a distress signal from a distant planet. When a three-member team of the crew discovers a chamber containing thousands of eggs on the planet, a creature inside one of the eggs attacks an explorer. The entire crew is unaware of the impending nightmare set to descend upon them when the alien parasite planted inside its unfortunate host is birthed.',3.838649,'/uU9R1byS3USozpzWJ5oz7YAkXyk.jpg','undefined','1979-05-25'),(391,'A Fistful of Dollars','undefined','The Man With No Name enters the Mexican village of San Miguel in the midst of a power struggle among the three Rojo brothers and sheriff John Baxter. When a regiment of Mexican soldiers bearing gold intended to pay for new weapons is waylaid by the Rojo brothers, the stranger inserts himself into the middle of the long-simmering battle, selling false information to both sides for his own benefit.',2.204033,'/sFLgxvtK9vxbNq502peVJ847Owp.jpg','undefined','1964-09-12'),(424,'Schindler\'s List','undefined','Told from the perspective of businessman Oskar Schindler who saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory. Schindler’s List is based on a true story, illustrated in black and white and controversially filmed in many original locations.',2.629339,'/yPisjyLweCl1tbgwgtzBCNCBle.jpg','undefined','1993-11-29'),(425,'Ice Age','undefined','With the impending ice age almost upon them, a mismatched trio of prehistoric critters -- Manny the woolly mammoth, Diego the saber-toothed tiger and Sid the giant sloth -- find an orphaned infant and decide to return it to its human parents. Along the way, the unlikely allies become friends. But when enemies attack, their quest takes on far nobler aims..',4.698824,'/zpaQwR0YViPd83bx1e559QyZ35i.jpg','undefined','2002-03-15'),(429,'The Good, the Bad and the Ugly','undefined','While the Civil War rages between the Union and the Confederacy, three men – a quiet loner, a ruthless hit man and a Mexican bandit – comb the American Southwest in search of a strongbox containing $200,000 in stolen gold.',2.539405,'/8PD1dgf0kQHtRawoSxp1jFemI1q.jpg','undefined','1966-12-23'),(453,'A Beautiful Mind','undefined','At Princeton University, John Nash struggles to make a worthwhile contribution to serve as his legacy to the world of mathematics. He finally makes a revolutionary breakthrough that will eventually earn him the Nobel Prize. After graduate school he turns to teaching, becoming romantically involved with his student Alicia. Meanwhile the government asks his help with breaking Soviet codes, which soon gets him involved in a terrifying conspiracy plot. Nash grows more and more paranoid until a discovery that turns his entire world upside down. Now it is only with Alicia\'s help that he will be able to recover his mental strength and regain his status as the great mathematician we know him as today..',3.757686,'/4SFqHDZ1NvWdysucWbgnYlobdxC.jpg','undefined','2001-12-12'),(534,'Terminator Salvation','undefined','All grown up in post-apocalyptic 2018, John Connor must lead the resistance of humans against the increasingly dominating militaristic robots. But when Marcus Wright appears, his existence confuses the mission as Connor tries to determine whether Wright has come from the future or the past -- and whether he\'s friend or foe.',12.114404,'/hxDfhavtxA2Ayx7O9BsQMcZRdG0.jpg','undefined','2009-05-20'),(539,'Psycho','undefined','When larcenous real estate clerk Marion Crane goes on the lam with a wad of cash and hopes of starting a new life, she ends up at the notorious Bates Motel, where manager Norman Bates cares for his housebound mother. The place seems quirky, but fine… until Marion decides to take a shower.',3.485545,'/oVXm1eBwkgBsOlzTgsMtgkPB2Ha.jpg','undefined','1960-06-16'),(581,'Dances with Wolves','undefined','Wounded Civil War soldier John Dunbar tries to commit suicide -- and becomes a hero instead. As a reward, he\'s assigned to his dream post, a remote junction on the Western frontier, and soon makes unlikely friends with the local Sioux tribe.',3.391381,'/hpmclspug1I8EwKSWhL7pWWltA.jpg','undefined','1990-11-09'),(585,'Monsters, Inc.','undefined','James Sullivan and Mike Wazowski are monsters, they earn their living scaring children and are the best in the business... even though they\'re more afraid of the children than they are of them. When a child accidentally enters their world, James and Mike suddenly find that kids are not to be afraid of and they uncover a conspiracy that could threaten all children across the world.',5.163894,'/93Y9BGx8blzmZOPSoivkFfaifqU.jpg','undefined','2001-11-01'),(597,'Titanic','undefined','84 years later, a 101-year-old woman named Rose DeWitt Bukater tells the story to her granddaughter Lizzy Calvert, Brock Lovett, Lewis Bodine, Bobby Buell and Anatoly Mikailavich on the Keldysh about her life set in April 10th 1912, on a ship called Titanic when young Rose boards the departing ship with the upper-class passengers and her mother, Ruth DeWitt Bukater, and her fiancé, Caledon Hockley. Meanwhile, a drifter and artist named Jack Dawson and his best friend Fabrizio De Rossi win third-class tickets to the ship in a game. And she explains the whole story from departure until the death of Titanic on its first and last voyage April 15th, 1912 at 2:20 in the morning.',4.706577,'/kHXEpyfl6zqn8a6YuozZUujufXf.jpg','undefined','1997-12-19'),(600,'Full Metal Jacket','undefined','A pragmatic U.S. Marine observes the dehumanizing effects the U.S.-Vietnam War has on his fellow recruits from their brutal boot camp training to the bloody street fighting in Hue.',2.881237,'/vM5Pkp4L6nB9TzNARhrToOE11IX.jpg','undefined','1987-05-31'),(616,'The Last Samurai','undefined','Nathan Algren is an American hired to instruct the Japanese army in the ways of modern warfare -- in this lush epic set in the 1870s, which finds Algren learning to respect the samurai and the honorable principles that rule them. Pressed to destroy the samurai\'s way of life in the name of modernization and open trade, Algren decides to become an ultimate warrior himself and to fight for their right to exist.',3.231204,'/sLv5pXysIz7QbtKFJy85d5yxv2W.jpg','undefined','2003-12-05'),(671,'Harry Potter and the Philosopher\'s Stone','undefined','Harry Potter has lived under the stairs at his aunt and uncle\'s house his whole life. But on his 11th birthday, he learns he\'s a powerful wizard -- with a place waiting for him at the Hogwarts School of Witchcraft and Wizardry. As he learns to harness his newfound powers with the help of the school\'s kindly headmaster, Harry uncovers the truth about his parents\' deaths -- and about the villain who\'s to blame.',5.476486,'/dCtFvscYcXQKTNvyyaQr2g2UacJ.jpg','undefined','2001-11-04'),(672,'Harry Potter and the Chamber of Secrets','undefined','Everyone\'s favorite novice wizard, Harry Potter, continues his high-flying adventures at Hogwarts. This time around, Harry ignores warnings not to return to school - that is, if he values his life - to investigate a mysterious series of attacks with Ron and Hermione.',5.568972,'/lryNn7sNkvQIg45KwgeKnMxSSRX.jpg','undefined','2002-11-03'),(673,'Harry Potter and the Prisoner of Azkaban','undefined','Harry, Ron and Hermione return to Hogwarts for a third adventure and magic filled year in this follow-up to the first two Potter blockbusters. Harry comes face to face with danger yet again, this time in the form of escaped convict Sirius Black. In a bid for help, Harry turns to sympathetic Professor Lupin -- but will it be enough?',5.346069,'/qMn0YCWKxt7xg8nqRnRj2Ei9qgx.jpg','undefined','2004-05-31'),(674,'Harry Potter and the Goblet of Fire','undefined','Young wizard Harry Potter starts his fourth year at Hogwarts, competes in the treacherous Tri-Wizard Tournament and faces the evil Lord Voldemort. Friends Ron and Hermione help Harry manage the pressure … but Voldemort lurks, awaiting his chance to destroy Harry and all that he stands for.',5.773395,'/6sASqcdrEHXxUhA3nFpjrRecPD2.jpg','undefined','2005-11-05'),(694,'The Shining','undefined','Jack Torrance accepts a caretaker job at the Overlook Hotel, where he, along with his wife Wendy and their son Danny, must live isolated from the rest of the world for the winter. But they aren\'t prepared for the madness that lurks within.',3.409081,'/9fgh3Ns1iRzlQNYuJyK0ARQZU7w.jpg','undefined','1980-05-22'),(783,'Gandhi','undefined','In 1893, Gandhi is thrown off a South African train for being an Indian and traveling in a first class compartment. Gandhi realizes that the laws are biased against Indians and decides to start a non-violent protest campaign for the rights of all Indians in South Africa. After numerous arrests and the unwanted attention of the world, the government finally relents by recognizing rights for Indians, though not for the native blacks of South Africa. After this victory, Gandhi is invited back to India, where he is now considered something of a national hero. He is urged to take up the fight for India\'s independence from the British Empire. Gandhi agrees, and mounts a non-violent non-cooperation campaign of unprecedented scale, coordinating millions of Indians nationwide. There are some setbacks, such as violence against the protesters and Gandhi\'s occasional imprisonment. Nevertheless...',2.677768,'/2z9A4FSu1YySrhhcuqkdMIXpgyN.jpg','undefined','1982-11-30'),(809,'Shrek 2','undefined','Shrek, Fiona and Donkey set off to Far, Far Away to meet Fiona\'s mother and father. But not everyone is happy. Shrek and the King find it hard to get along, and there\'s tension in the marriage. The fairy godmother discovers that Shrek has married Fiona instead of her Son Prince Charming and sets about destroying their marriage.',6.093613,'/akWDA0BMVYK4OTM92T5i91DYnsT.jpg','undefined','2004-05-18'),(812,'Aladdin','undefined','Princess Jasmine grows tired of being forced to remain in the palace and she sneaks out into the marketplace  in disguise where she meets street-urchin Aladdin and the two fall in love, although she may only marry a prince. After being thrown in jail, Aladdin and becomes embroiled in a plot to find a mysterious lamp with which the evil Jafar hopes to rule the land.',6.27835,'/qsHpmqekgeQKMKL8PWnFsrXTXGs.jpg','undefined','1992-11-25'),(820,'JFK','undefined','New Orleans District Attorney Jim Garrison discovers there\'s more to the Kennedy assassination than the official story.',3.367711,'/9bmXpKDJv2kdtD4QNexErjGTIOz.jpg','undefined','1991-12-20'),(855,'Black Hawk Down','undefined','When U.S. Rangers and an elite Delta Force team attempt to kidnap two underlings of a Somali warlord, their Black Hawk helicopters are shot down, and the Americans suffer heavy casualties, facing intense fighting from the militia on the ground.',1.985938,'/yUzQ4r3q1Dy0bUAkMvUIwf0rPpR.jpg','undefined','2001-12-28'),(857,'Saving Private Ryan','undefined','As U.S. troops storm the beaches of Normandy, three brothers lie dead on the battlefield, with a fourth trapped behind enemy lines. Ranger captain John Miller and seven men are tasked with penetrating German-held territory and bringing the boy home.',4.79799,'/gc7IN6bWNaWXv4vI6cxSmeB7PeO.jpg','undefined','1998-07-24'),(862,'Toy Story','undefined','Woody the cowboy is young Andy’s favorite toy. Yet this changes when Andy get the new super toy Buzz Lightyear for his birthday. Now that Woody is no longer number one he plans his revenge on Buzz. Toy Story is a milestone in film history for being the first feature film to use entirely computer animation.',5.357121,'/agy8DheVu5zpQFbXfAdvYivF2FU.jpg','undefined','1995-11-21'),(920,'Cars','undefined','Lightning McQueen, a hotshot rookie race car driven to succeed, discovers that life is about the journey, not the finish line, when he finds himself unexpectedly detoured in the sleepy Route 66 town of Radiator Springs. On route across the country to the big Piston Cup Championship in California to compete against two seasoned pros, McQueen gets to know the town\'s offbeat characters.',4.388586,'/xi7KxnMSQzlqyCyCrXFJUJFdtxm.jpg','undefined','2006-06-09'),(1250,'Ghost Rider','undefined','In order to save his dying father, young stunt cyclist Johnny Blaze sells his soul to Mephistopheles and sadly parts from the pure-hearted Roxanne Simpson, the love of his life. Years later, Johnny\'s path crosses again with Roxanne, now a gogetting reporter, and also with Mephistopheles, who offers to release Johnny\'s soul if Johnny becomes the fabled, fiery Ghost Rider.',3.499416,'/soDF6i4eREQN4JPuSzpAqWDZmU4.jpg','undefined','2007-02-16'),(1368,'First Blood','undefined','When former Green Beret John Rambo is harassed by local law enforcement and arrested for vagrancy, the Vietnam vet snaps, runs for the hills and rat-a-tat-tats his way into the action-movie hall of fame. Hounded by a relentless sheriff, Rambo employs heavy-handed guerilla tactics to shake the cops off his tail.',2.830517,'/xl5W9LHaXQG63LmLiNg90qpes2W.jpg','undefined','1982-10-22'),(1656,'The Legend of Zorro','undefined','In 1850, the people of California were voting to decide whether or not to join the United States. The Legend of Zorro is a 2005 sequel to 1998\'s The Mask of Zorro,',2.416229,'/rH3WJbSE3APS1l1hTXZZbz3NVP1.jpg','undefined','2005-10-25'),(1771,'Captain America: The First Avenger','undefined','Predominantly set during World War II, Steve Rogers is a sickly man from Brooklyn who\'s transformed into super-soldier Captain America to aid in the war effort. Rogers must stop the Red Skull – Adolf Hitler\'s ruthless head of weaponry, and the leader of an organization that intends to use a mysterious device of untold powers for world domination.',9.888453,'/dlIPGXPxXQTp9kFrRzn0RsfUelx.jpg','undefined','2011-07-22'),(1966,'Alexander','undefined','Alexander, the King of Macedonia, leads his legions against the giant Persian Empire. After defeating the Persians he leads his Army across the then known world venturing further than any Westerner had ever gone all the way to India.',2.492635,'/cJrnmbsFm5cEt0pHZZ2a1ueH5aT.jpg','undefined','2004-11-24'),(2059,'National Treasure','undefined','Modern treasure hunters, led by archaeologist Ben Gates, search for a chest of riches rumored to have been stashed away by George Washington, Thomas Jefferson and Benjamin Franklin during the Revolutionary War. The chest\'s whereabouts may lie in secret clues embedded in the Constitution and the Declaration of Independence, and Gates is in a race to find the gold before his enemies do.',4.493001,'/luMoc56LLMWUt60vUNNpwxrbTNt.jpg','undefined','2004-11-08'),(2253,'Valkyrie','undefined','Wounded in Africa during World War II, Nazi Col. Claus von Stauffenberg returns to his native Germany and joins the Resistance in a daring plan to create a shadow government and assassinate Adolf Hitler. When events unfold so that he becomes a central player, he finds himself tasked with both leading the coup and personally killing the Führer.',2.597924,'/54GgkO63zZyJJb5Fk2CKvNIoUvr.jpg','undefined','2008-12-25'),(6479,'I Am Legend','undefined','Robert Neville is a scientist who was unable to stop the spread of the terrible virus that was incurable and man-made. Immune, Neville is now the last human survivor in what is left of New York City and perhaps the world. For three years, Neville has faithfully sent out daily radio messages, desperate to find any other survivors who might be out there. But he is not alone.',4.431637,'/cs6SY4HnPV8DUPVLSploHnwWWjq.jpg','undefined','2007-12-13'),(8328,'Step Up 2: The Streets','undefined','When rebellious street dancer Andie lands at the elite Maryland School of the Arts, she finds herself fighting to fit in while also trying to hold onto her old life. When she joins forces with the schools hottest dancer, Chase, to form a crew of classmate outcasts to compete in Baltimore s underground dance battle The Streets.',2.488354,'/5SwoeOUyfkS8s6aGB2bLYAL5jKR.jpg','undefined','2008-02-14'),(8966,'Twilight','undefined','When Bella Swan moves to a small town in the Pacific Northwest to live with her father, she starts school and meets the reclusive Edward Cullen, a mysterious classmate who reveals himself to be a 108-year-old vampire. Despite Edward\'s repeated cautions, Bella can\'t help but fall in love with him, a fatal move that endangers her own life when a coven of bloodsuckers try to challenge the Cullen clan.',2.812154,'/nlvPMLCdum7bkHKmDSMnNLGztmW.jpg','undefined','2008-11-20'),(9762,'Step Up','undefined','Everyone deserves a chance to follow their dreams, but some people only get one shot. Tyler Gage is a rebel from the wrong side of Baltimore¹s tracks and the only thing that stands between him and an unfulfilled life are his dreams of one day making it out of there. Nora is a privileged ballet dancer attending Baltimore¹s ultra-elite Maryland School of the Arts',3.607729,'/uy1kUNtvYTZLkBSpQP8FQMRdAg7.jpg','undefined','2006-08-11'),(9806,'The Incredibles','undefined','Bob Parr has given up his superhero days to log in time as an insurance adjuster and raise his three children with his formerly heroic wife in suburbia. But when he receives a mysterious assignment, it\'s time to get back into costume.',5.83923,'/XgTh6Afh7PG6yuLqqBAzqpmsZg.jpg','undefined','2004-11-04'),(10020,'Beauty and the Beast','undefined','Follow the adventures of Belle, a bright young woman who finds herself in the castle of a prince who\'s been turned into a mysterious beast. With the help of the castle\'s enchanted staff, Belle soon learns the most important lesson of all -- that true beauty comes from within.',3.903846,'/b9QJr2oblOu1grgOMUZF1xkUJdh.jpg','undefined','1991-11-12'),(10528,'Sherlock Holmes','undefined','Eccentric consulting detective Sherlock Holmes and Doctor John Watson battle to bring down a new nemesis and unravel a deadly plot that could destroy England.',3.759588,'/22ngurXbLqab7Sko6aTSdwOCe5W.jpg','undefined','2009-12-25'),(10693,'Peter Pan','undefined','Leaving the safety of their nursery behind, Wendy, Michael and John follow Peter Pan to a magical world where childhood lasts forever. But while in Neverland, the kids must face Captain Hook and foil his attempts to get rid of Peter for good.',2.910982,'/aWLgUzpkVFk8OVcg5jJte5I0Ces.jpg','undefined','1953-02-05'),(10947,'High School Musical','undefined','Troy (Zac Efron), the popular captain of the basketball team, and Gabriella (Vanessa Anne Hudgens), the brainy and beautiful member of the academic club, break all the rules of East High society when they secretly audition for the leads in the school\'s musical. As they reach for the stars and follow their dreams, everyone learns about acceptance, teamwork, and being yourself. And it\'s all set to fun tunes and very cool dance moves!',1.76986,'/nJPhjD6HCE6vPokWKuJtc9yX196.jpg','undefined','2006-01-20'),(11135,'The Rescuers Down Under','undefined','A lawless poacher wants to capture a majestic and rare golden eagle, so he kidnaps the boy who knows where to find the bird. Not to worry -- the Rescue Aid Society\'s top agents, heroic mice Miss Bianca and Bernard, fly to Australia to save the day. Accompanying the fearless duo are bumbling albatross Wilbur and local field operative Jake the Kangaroo Rat.',10.288753,'/vweXLAZP6E55EaMeedndhBdXQGu.jpg','undefined','1990-11-16'),(11969,'Tombstone','undefined','Legendary marshal Wyatt Earp, now a weary gunfighter, joins his brothers Morgan and Virgil to pursue their collective fortune in the thriving mining town of Tombstone. But Earp is forced to don a badge again and get help from his notorious pal Doc Holliday when a gang of renegade brigands and rustlers begins terrorizing the town.',2.316068,'/yU4e7OAJruAQpAsakzbDpPsQrU7.jpg','undefined','1993-12-25'),(12094,'Jackass Number Two','undefined','Jackass Number Two is a compilation of various stunts, pranks and skits, and essentially has no plot. Chris Pontius, Johnny Knoxville, Steve-O, Bam Margera, and the whole crew return to the screen to raise the stakes higher than ever before.',2.064326,'/tu4BZcdkAuah70ilVT30Wfo2HjF.jpg','undefined','2006-09-22'),(12155,'Alice in Wonderland','undefined','Alice, an unpretentious and individual 19-year-old, is betrothed to a dunce of an English nobleman. At her engagement party, she escapes the crowd to consider whether to go through with the marriage and falls down a hole in the garden after spotting an unusual rabbit. Arriving in a strange and surreal place called \'Underland,\' she finds herself in a world that resembles the nightmares she had as a child, filled with talking animals, villainous queens and knights, and frumious bandersnatches. Alice realizes that she is there for a reason--to conquer the horrific Jabberwocky and restore the rightful queen to her throne.',4.463549,'/pvEE5EN5N1yjmHmldfL4aJWm56l.jpg','undefined','2010-03-04'),(12162,'The Hurt Locker','undefined','Forced to play a dangerous game of cat-and-mouse in the chaos of war, an elite Army bomb squad unit must come together in a city where everyone is a potential enemy and every object could be a deadly bomb.',3.102475,'/uduCNFTuEcbvhvK8rrvNdf3ahzW.jpg','undefined','2008-10-10'),(12444,'Harry Potter and the Deathly Hallows: Part 1','undefined','The end begins as Harry, Ron, and Hermione walk away from their last year at Hogwarts to find and destroy the remaining Horcruxes, putting an end to Voldemort\'s bid for immortality. But with Harry\'s beloved Dumbledore dead and Voldemort\'s unscrupulous Death Eaters on the loose, the world is more dangerous than ever.',5.853616,'/maP4MTfPCeVD2FZbKTLUgriOW4R.jpg','undefined','2010-11-19'),(13187,'A Charlie Brown Christmas','undefined','When Charlie Brown complains about the overwhelming materialism that he sees amongst everyone during the Christmas season, Lucy suggests that he become director of the school Christmas pageant. Charlie Brown accepts, but is a frustrating struggle. When an attempt to restore the proper spirit with a forlorn little fir Christmas tree fails, he needs Linus\' help to learn the meaning of Christmas.',1.854313,'/b8EXfgoyv3AlGyM0yb8eIp3XVI2.jpg','undefined','1965-12-09'),(13590,'Eddie Izzard: Glorious','undefined','Eddie Izzard\'s routine has a loose trajectory from the beginning of the Old Testament and the creation of the world in seven days to Revelations. Along the way, we learn of the search for a career, bad giraffes, Prince Philip\'s gaffes, toilets in French campsites, the mysteries of hopscotch, becoming one\'s Dad and tranny bashing.',15.734488,'/ub8d4LNtfwfibUclk89KDNQJx5k.jpg','undefined','1997-11-17'),(14158,'Jackass 2.5','undefined','The crew have now set off to finish what as left over from Jackass 2.0, and in this version they have Wee Man use a \'pee\' gun on themselves, having a mini motor bike fracas in the grocery mall, a sperm test, a portly crew member disguised as King Kong, as well as include three episodes of their hilarious adventures in India.',1.041201,'/jNSufmwIL6tsIOhTZ1FN47Mdf4T.jpg','undefined','2007-12-18'),(14756,'Ip Man','undefined','A semi-biographical account of Yip Man, the first martial arts master to teach the Chinese martial art of Wing Chun. The film focuses on events surrounding Ip that took place in the city of Foshan between the 1930s to 1940s during the Second Sino-Japanese War. Directed by Wilson Yip, the film stars Donnie Yen in the lead role, and features fight choreography by Sammo Hung.',2.966596,'/8knFfuqW289DJi2cpPl4RVTDkbo.jpg','undefined','2008-12-12'),(16290,'Jackass 3D','undefined','Jackass 3D is a 3-D film and the third movie of the Jackass series. It follows the same premise as the first two movies, as well as the TV series. It is a compilation of various pranks, stunts and skits. Before the movie begins, a brief introduction is made by Beavis and Butt-head explaining the 3D technology behind the movie. The intro features the cast lining up and then being attacked by various objects in slow-motion. The movie marks the 10th anniversary of the franchise, started in 2000.',1.853243,'/5j9VFEVjYn0FtqZGqDcmMPYSVoY.jpg','undefined','2010-10-15'),(17578,'The Adventures of Tintin','undefined','Intrepid young reporter Tintin and his loyal dog Snowy are thrust into a world of high adventure when they discover a ship carrying an explosive secret. As Tintin is drawn into a centuries-old mystery, Ivan Ivanovitch Sakharine suspects him of stealing a priceless treasure. Tintin and Snowy, with the help of salty, cantankerous Captain Haddock, and bumbling detectives Thompson &amp; Thomson, travel half the world, one step ahead of their enemies as Tintin endeavors to find The Unicorn, a sunken ship that may hold a vast fortune, but also an ancient curse.',4.014751,'/bDE10SyVAFEBrwI6qettdCHQjT.jpg','undefined','2011-12-20'),(18988,'The Lion in Winter','undefined','1183 AD: King Henry II\'s three sons all want to inherit the throne, but he won\'t commit to a choice. They and his wife variously plot to force him.',2.700663,'/zzK551e51k00SlofHZfmS5zcWhy.jpg','undefined','1968-10-30'),(19995,'Avatar','undefined','In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien civilization.',7.188386,'/tcqb9NHdw9SWs2a88KCDD4V8sVR.jpg','undefined','2009-12-18'),(22971,'Dear John','undefined','Sergeant John Tyree is home on a 2 week leave from Germany. He meets Savannah after he dives into the ocean to retrieve Savannah\'s purse that had fallen off the pier. John falls in love with Savannah who is a student on spring break helping build a house for Habitat for Humanity. A romance occurs and Savannah falls deeply in love with John. She promises to write John overseas until he returns.',2.97582,'/2Fen9XsCscjupGJUhi2zaCvOaGd.jpg','undefined','2010-02-04'),(23398,'Alvin and the Chipmunks: The Squeakquel','undefined','Pop sensations Alvin, Simon and Theodore end up in the care of Dave Seville\'s twenty-something nephew Toby. The boys must put aside music super stardom to return to school, and are tasked with saving the school\'s music program by winning the $25,000 prize in a battle of the bands. But the Chipmunks unexpectedly meet their match in three singing chipmunks known as The Chipettes - Brittany, Eleanor and Jeanette. Romantic and musical sparks are ignited when the Chipmunks and Chipettes square off.',2.407155,'/dpY7igIBW0Gw8LVLYgbCvjgc2aR.jpg','undefined','2009-12-21'),(36648,'Blade: Trinity','undefined','For years, Blade has fought against the vampires in the cover of the night. But now, after falling into the crosshairs of the FBI, he is forced out into the daylight, where he is driven to join forces with a clan of human vampire hunters he never knew existed - The Nightstalkers. Together with Abigail and Hannibal, two deftly trained Nightstalkers, Blade follows a trail of blood to the ancient creature that is also hunting him, the original vampire, Dracula.',3.724172,'/4WinsdHQBdh5aTt7Bd7T7dbUXbb.jpg','undefined','2004-12-07'),(38055,'Megamind','undefined','Bumbling supervillain Megamind finally defeats his nemesis, the superhero Metro Man. But without a hero, he loses all purpose and must find new meaning to his life.',4.535992,'/amXAUSAUrnGuLGEyc1ZNhBvgbnF.jpg','undefined','2010-11-04'),(44896,'Rango','undefined','When Rango, a lost family pet, accidentally winds up in the gritty, gun-slinging town of Dirt, the less-than-courageous lizard suddenly finds he stands out. Welcomed as the last hope the town has been waiting for, new Sheriff Rango is forced to play his new role to the hilt.',1.892289,'/dQ6JElhTmauGWAyxu1k1uPrxupr.jpg','undefined','2011-03-03'),(45269,'The King\'s Speech','undefined','The King\'s Speech tells the story of the man who became King George VI, the father of Queen Elizabeth II. After his brother abdicates, George (\'Bertie\') reluctantly assumes the throne. Plagued by a dreaded stutter and considered unfit to be king, Bertie engages the help of an unorthodox speech therapist named Lionel Logue. Through a set of unexpected techniques, and as a result of an unlikely friendship, Bertie is able to find his voice and boldly lead the country into war.',3.306541,'/nkFTbA1XjKWo9LCTaV1hV2Lsgr1.jpg','undefined','2010-09-06'),(49017,'Dracula Untold','undefined','Vlad Tepes is a great hero, but when he learns the Sultan is preparing for battle and needs to form an army of 1,000 boys, including Vlad\'s son, he vows to find a way to protect his family. Vlad turns to dark forces in order to get the power to destroy his enemies and agrees to go from hero to monster as he\'s turned into the mythological vampire Dracula.',7.345568,'/4oy4e0DP6LRwRszfx8NY8EYBj8V.jpg','undefined','2014-10-03'),(49026,'The Dark Knight Rises','undefined','Following the death of District Attorney Harvey Dent, Batman assumes responsibility for Dent\'s crimes to protect the late attorney\'s reputation and is subsequently hunted by the Gotham City Police Department. Eight years later, Batman encounters the mysterious Selina Kyle and the villainous Bane, a new terrorist leader who overwhelms Gotham\'s finest. The Dark Knight resurfaces to protect a city that has branded him an enemy.',7.57512,'/dEYnvnUfXrqvqeRSqvIEtmzhoA8.jpg','undefined','2012-07-20'),(49051,'The Hobbit: An Unexpected Journey','undefined','Bilbo Baggins, a hobbit enjoying his quiet life, is swept into an epic quest by Gandalf the Grey and thirteen dwarves who seek to reclaim their mountain home from Smaug, the dragon.',6.756499,'/w29Guo6FX6fxzH86f8iAbEhQEFC.jpg','undefined','2012-12-14'),(49849,'Cowboys & Aliens','undefined','A stranger stumbles into the desert town of Absolution with no memory of his past and a futuristic shackle around his wrist. With the help of mysterious beauty Ella and the iron-fisted Colonel Dolarhyde, he finds himself leading an unlikely posse of cowboys, outlaws, and Apache warriors against a common enemy from beyond this world in an epic showdown for survival.',2.349394,'/tXEHvxU315Yu7bEaMMRcpDpW6RI.jpg','undefined','2011-07-29'),(57158,'The Hobbit: The Desolation of Smaug','undefined','The Dwarves, Bilbo and Gandalf have successfully escaped the Misty Mountains, and Bilbo has gained the One Ring. They all continue their journey to get their gold back from the Dragon, Smaug.',6.504266,'/gQCiuxGsfiXH1su6lp9n0nd0UeH.jpg','undefined','2013-12-13'),(57201,'The Lone Ranger','undefined','The Texas Rangers chase down a gang of outlaws led by Butch Cavendish, but the gang ambushes the Rangers, seemingly killing them all. One survivor is found, however, by an American Indian named Tonto, who nurses him back to health. The Ranger, donning a mask and riding a white stallion named Silver, teams up with Tonto to bring the unscrupulous gang and others of that ilk to justice.',1.600472,'/b4vil5ueYJNBNypHmo1tpuevh4z.jpg','undefined','2013-07-03'),(60304,'Hansel & Gretel: Witch Hunters','undefined','After getting a taste for blood as children, Hansel and Gretel have become the ultimate vigilantes, hell-bent on retribution. Now, unbeknownst to them, Hansel and Gretel have become the hunted, and must face an evil far greater than witches... their past.',3.466927,'/3bQHHXuzZDu2Ju3VFjIM72E9TSw.jpg','undefined','2013-01-25'),(64682,'The Great Gatsby','undefined','An adaptation of F. Scott Fitzgerald\'s Long Island-set novel, where Midwesterner Nick Carraway is lured into the lavish world of his neighbor, Jay Gatsby. Soon enough, however, Carraway will see through the cracks of Gatsby\'s nouveau riche existence, where obsession, madness, and tragedy await.',2.902339,'/oJpOYPpVWyPeunGbbDGH1KFvea0.jpg','undefined','2013-05-10'),(65851,'Jackass 3.5','undefined','Jackass 3.5 is a 2011 sequel to Jackass 3D, composed of unused footage shot during the filming of Jackass 3D and interviews from cast and crew',1.9775,'/ppjN0BZaOJ6aHMXsECHJ0dpFb8Z.jpg','undefined','2011-08-03'),(68718,'Django Unchained','undefined','With the help of a German bounty hunter, a freed slave sets out to rescue his wife from a brutal Mississippi plantation owner.',5.475505,'/5WJnxuw41sddupf8cwOxYftuvJG.jpg','undefined','2012-12-25'),(70981,'Prometheus','undefined','A team of explorers discover a clue to the origins of mankind on Earth, leading them on a journey to the darkest corners of the universe. There, they must fight a terrifying battle to save the future of the human race.',2.826119,'/ng8ALjSDhUmwLl7vtjUWIZNQSlt.jpg','undefined','2012-06-08'),(71689,'Phineas and Ferb the Movie: Across the 2nd Dimension','undefined','Perry\'s worst fear comes true when Phineas and Ferb finds out that he is in fact Secret Agent P, but that soon pales in comparison during a trip to the 2nd dimension where Perry finds out that Dr. Doofenshmirtz is truly evil and successful.',1.962986,'/e8BU8p2fA0snRQMs3EtvsxCtfFZ.jpg','undefined','2011-08-05'),(72190,'World War Z','undefined','Life for former United Nations investigator Gerry Lane and his family seems content. Suddenly, the world is plagued by a mysterious infection turning whole human populations into rampaging mindless zombies. After barely escaping the chaos, Lane is persuaded to go on a mission to investigate this disease. What follows is a perilous trek around the world where Lane must brave horrific dangers and long odds to find answers before human civilization falls.',3.739843,'/Ha5t0J21eyiq6Az1EXzx0iwsGH.jpg','undefined','2013-06-21'),(72976,'Lincoln','undefined','A revealing drama that focuses on the 16th President\'s tumultuous final months in office. In a nation divided by war and the strong winds of change, Lincoln pursues a course of action designed to end the war, unite the country and abolish slavery. With the moral courage and fierce determination to succeed, his choices during this critical moment will change the fate of generations to come.',3.382213,'/gkkiDu9srCCbCMxGKwNwKCxK7KF.jpg','undefined','2012-11-16'),(75612,'Oblivion','undefined','Jack Harper (Tom Cruise) is one of the last few drone repairmen stationed on Earth.  Part of a massive operation to extract vital resources after decades of war with a terrifying threat known as the Scavs, Jack’s mission is nearly complete.  His existence is brought crashing down when he rescues a beautiful  stranger from a downed spacecraft.  Her arrival triggers a chain of events that  forces him to question everything he knows and puts the fate of humanity in his hands.',4.051073,'/hmOzkHlkGvi8x24fYpFSnXvjklv.jpg','undefined','2013-04-18'),(76203,'12 Years a Slave','undefined','In the pre-Civil War United States, Solomon Northup, a free black man from upstate New York, is abducted and sold into slavery. Facing cruelty as well as unexpected kindnesses Solomon struggles not only to stay alive, but to retain his dignity. In the twelfth year of his unforgettable odyssey, Solomon’s chance meeting with a Canadian abolitionist will forever alter his life.',3.45201,'/kb3X943WMIJYVg4SOAyK0pmWL5D.jpg','undefined','2013-10-30'),(76338,'Thor: The Dark World','undefined','Thor fights to restore order across the cosmos… but an ancient race led by the vengeful Malekith returns to plunge the universe back into darkness. Faced with an enemy that even Odin and Asgard cannot withstand, Thor must embark on his most perilous and personal journey yet, one that will reunite him with Jane Foster and force him to sacrifice everything to save us all.',8.450169,'/6t3KOEUtrIPmmtu1czzt6p2XxJy.jpg','undefined','2013-11-08'),(76341,'Mad Max: Fury Road','undefined','An apocalyptic story set in the furthest reaches of our planet, in a stark desert landscape where humanity is broken, and most everyone is crazed fighting for the necessities of life. Within this world exist two rebels on the run who just might be able to restore order. There\'s Max, a man of action and a man of few words, who seeks peace of mind following the loss of his wife and child in the aftermath of the chaos. And Furiosa, a woman of action and a woman who believes her path to survival may be achieved if she can make it across the desert back to her childhood homeland.',21.156824,'/kqjL17yufvn9OVLyXYpvtyrFfak.jpg','undefined','2015-05-15'),(76757,'Jupiter Ascending','undefined','In a universe where human genetic material is the most precious commodity, an impoverished young Earth woman becomes the key to strategic maneuvers and internal strife within a powerful dynasty…',10.395678,'/aMEsvTUklw0uZ3gk3Q6lAj6302a.jpg','undefined','2015-02-05'),(79218,'Ice Age: A Mammoth Christmas','undefined','When Sid accidentally destroys Manny\'s heirloom Christmas rock and ends up on Santa\'s naughty list, he leads a hilarious quest to the North Pole to make things right and ends up making things much worse. Now it\'s up to Manny and his prehistoric posse to band together and save Christmas for the entire world!',1.761855,'/bBKkG54YXVTFCKeZ4a5pmRubTQg.jpg','undefined','2011-11-24'),(82693,'Silver Linings Playbook','undefined','After spending eight months in a mental institution, a former teacher moves back in with his parents and tries to reconcile with his ex-wife.',5.417453,'/ilrZAV2klTB0FLxLb01bOp5pzD9.jpg','undefined','2012-12-25'),(84174,'Bachelorette','undefined','Regan is used to being first at everything. Imagine her horror and chagrin when she finds out the girl everyone called Pig Face in high school is going to tie the knot before she does! But Regan sucks it up and takes on bridesmaid duties along with her childhood pals: substance-abusing, promiscuous Gena and ditzy Katie. The single ladies are determined to put their bitterness aside and have an awesomely hedonistic bachelorette party. Armed with acerbic wit and seemingly endless supplies of coke and booze, the foul-mouthed femmes embark on one very long and emotional night filled with major wedding-dress panic, various bodily fluids, and cute ex-boyfriends.',4.191724,'/4lbsAlqCqXgocPdWuN6C95x2KC.jpg','undefined','2012-09-06'),(87101,'Terminator Genisys','undefined','The year is 2029. John Connor, leader of the resistance continues the war against the machines. At the Los Angeles offensive, John\'s fears of the unknown future begin to emerge when TECOM spies reveal a new plot by SkyNet that will attack him from both fronts; past and future, and will ultimately change warfare forever.',35.797207,'/5JU9ytZJyR3zmClGmVm9q4Geqbd.jpg','undefined','2015-07-01'),(93456,'Despicable Me 2','undefined','Gru is recruited by the Anti-Villain League to help deal with a powerful new super criminal.',5.101698,'/ek09KXB8ytg9nUb3hDUpJn7APdT.jpg','undefined','2013-07-03'),(97630,'Zero Dark Thirty','undefined','A chronicle of the decade-long hunt for al-Qaeda terrorist leader Osama bin Laden after the September 2001 attacks, and his death at the hands of the Navy S.E.A.L. Team 6 in May, 2011.',2.463187,'/yg6IDNucLAEj7E5loTyTnUW2pgb.jpg','undefined','2012-12-19'),(98566,'Teenage Mutant Ninja Turtles','undefined','The city needs heroes. Darkness has settled over New York City as Shredder and his evil Foot Clan have an iron grip on everything from the police to the politicians. The future is grim until four unlikely outcast brothers rise from the sewers and discover their destiny as Teenage Mutant Ninja Turtles. The Turtles must work with fearless reporter April and her wise-cracking cameraman Vern Fenwick to save the city and unravel Shredder\'s diabolical plan.',7.857125,'/oDL2ryJ0sV2bmjgshVgJb3qzvwp.jpg','undefined','2014-08-08'),(99861,'Avengers: Age of Ultron','undefined','When Tony Stark tries to jumpstart a dormant peacekeeping program, things go awry and Earth’s Mightiest Heroes are put to the ultimate test as the fate of the planet hangs in the balance. As the villainous Ultron emerges, it is up to The Avengers to stop him from enacting his terrible plans, and soon uneasy alliances and unexpected action pave the way for an epic and unique global adventure.',13.281163,'/t90Y3G8UGQp0f0DrP60wRu9gfrH.jpg','undefined','2015-05-01'),(100402,'Captain America: The Winter Soldier','undefined','After the cataclysmic events in New York with The Avengers, Steve Rogers, aka Captain America is living quietly in Washington, D.C. and trying to adjust to the modern world. But when a S.H.I.E.L.D. colleague comes under attack, Steve becomes embroiled in a web of intrigue that threatens to put the world at risk. Joining forces with the Black Widow, Captain America struggles to expose the ever-widening conspiracy while fighting off professional assassins sent to silence him at every turn. When the full scope of the villainous plot is revealed, Captain America and the Black Widow enlist the help of a new ally, the Falcon. However, they soon find themselves up against an unexpected and formidable enemy—the Winter Soldier.',10.572116,'/5TQ6YDmymBpnF005OyoB7ohZps9.jpg','undefined','2014-04-04'),(102382,'The Amazing Spider-Man 2','undefined','For Peter Parker, life is busy. Between taking out the bad guys as Spider-Man and spending time with the person he loves, Gwen Stacy, high school graduation cannot come quickly enough. Peter has not forgotten about the promise he made to Gwen’s father to protect her by staying away, but that is a promise he cannot keep. Things will change for Peter when a new villain, Electro, emerges, an old friend, Harry Osborn, returns, and Peter uncovers new clues about his past.',5.285063,'/mUjWof8LHDgCZC9mFp0UYKBf1Dm.jpg','undefined','2014-05-02'),(102651,'Maleficent','undefined','The untold story of Disney\'s most iconic villain from the 1959 classic \'Sleeping Beauty\'. A beautiful, pure-hearted young woman, Maleficent has an idyllic life growing up in a peaceable forest kingdom, until one day when an invading army threatens the harmony of the land.  Maleficent rises to be the land\'s fiercest protector, but she ultimately suffers a ruthless betrayal – an act that begins to turn her heart into stone. Bent on revenge, Maleficent faces an epic battle with the invading King\'s successor and, as a result, places a curse upon his newborn infant Aurora. As the child grows, Maleficent realizes that Aurora holds the key to peace in the kingdom - and to Maleficent\'s true happiness as well.',5.635786,'/4FYu1AAu14tuBU0lns0hbKiHUcH.jpg','undefined','2014-05-30'),(102899,'Ant-Man','undefined','Armed with the astonishing ability to shrink in scale but increase in strength, con-man Scott Lang must embrace his inner-hero and help his mentor, Dr. Hank Pym, protect the secret behind his spectacular Ant-Man suit from a new generation of towering threats. Against seemingly insurmountable obstacles, Pym and Lang must plan and pull off a heist that will save the world.',70.003821,'/D6e8RJf2qUstnfkTslTXNTUAlT.jpg','undefined','2015-08-14'),(105864,'The Good Dinosaur','undefined','An epic journey into the world of dinosaurs where an Apatosaurus named Arlo makes an unlikely human friend.',10.127716,'/2ZckiMTfSkCep2JTtZbr73tnQbN.jpg','undefined','2015-11-26'),(106646,'The Wolf of Wall Street','undefined','A New York stockbroker refuses to cooperate in a large securities fraud case involving corruption on Wall Street, corporate banking world and mob infiltration. Based on Jordan Belfort\'s autobiography.',5.796938,'/wAgdJRx4uZ0u4uzu34NOMvtjLAR.jpg','undefined','2013-12-25'),(109445,'Frozen','undefined','Young princess Anna of Arendelle dreams about finding true love at her sister Elsa’s coronation. Fate takes her on a dangerous journey in an attempt to end the eternal winter that has fallen over the kingdom. She\'s accompanied by ice delivery man Kristoff, his reindeer Sven, and snowman Olaf. On an adventure where she will find out what friendship, courage, family, and true love really means.',6.077811,'/jIjdFXKUNtdf1bwqMrhearpyjMj.jpg','undefined','2013-11-27'),(114150,'Pitch Perfect','undefined','College student Beca knows she does not want to be part of a clique, but that\'s exactly where she finds herself after arriving at her new school. Thrust in among mean gals, nice gals and just plain weird gals, Beca finds that the only thing they have in common is how well they sing together. She takes the women of the group out of their comfort zone of traditional arrangements and into a world of amazing harmonic combinations in a fight to the top of college music competitions.',2.883583,'/cLUMPdwCV0Dxd3P1ZkCXe7bVImI.jpg','undefined','2012-09-28'),(115290,'Blue Lagoon: The Awakening','undefined','Two high school students become stranded on a tropical island and must rely on each other for survival. They learn more about themselves and each other while falling in love.',2.105113,'/vg6SIzh3YbgvddmGE6vRbaDlsqD.jpg','undefined','2012-06-16'),(116741,'The Internship','undefined','Two recently laid-off men in their 40s try to make it as interns at a successful Internet company where their managers are in their 20s.',12.640668,'/xxOKDTQbQo7h1h7TyrQIW7u8KcJ.jpg','undefined','2013-06-07'),(118340,'Guardians of the Galaxy','undefined','Light years from Earth, 26 years after being abducted, Peter Quill finds himself the prime target of a manhunt after discovering an orb wanted by Ronan the Accuser.',13.277312,'/9gm3lL8JMTTmc3W4BmNMCuRLdL8.jpg','undefined','2014-08-01'),(119450,'Dawn of the Planet of the Apes','undefined','A group of scientists in San Francisco struggle to stay alive in the aftermath of a plague that is wiping out humanity, while Caesar tries to maintain dominance over his community of intelligent apes.',7.514888,'/2EUAUIu5lHFlkj5FRryohlH6CRO.jpg','undefined','2014-07-11'),(119698,'The Dinosaur Project','undefined','Found footage of an expedition into the Congo jungle where a team of explorers stumbles upon a colony of Dinosaurs.',1.728172,'/wuiY4NFrLvLT4iHS9Y9PfIctkC8.jpg','undefined','2012-08-09'),(127585,'X-Men: Days of Future Past','undefined','The ultimate X-Men ensemble fights a war for the survival of the species across two time periods as they join forces with their younger selves in an epic battle that must change the past – to save our future.',8.805869,'/qKkFk9HELmABpcPoc1HHZGIxQ5a.jpg','undefined','2014-05-23'),(131631,'The Hunger Games: Mockingjay - Part 1','undefined','Katniss Everdeen reluctantly becomes the symbol of a mass rebellion against the autocratic Capitol.',22.338223,'/cWERd8rgbw7bCMZlwP207HUXxym.jpg','undefined','2014-11-20'),(131634,'The Hunger Games: Mockingjay - Part 2','undefined','With the nation of Panem in a full scale war, Katniss confronts President Snow in the final showdown. Teamed with a group of her closest friends – including Gale, Finnick, and Peeta – Katniss goes off on a mission with the unit from District 13 as they risk their lives to stage an assassination attempt on President Snow who has become increasingly obsessed with destroying her. The mortal traps, enemies, and moral choices that await Katniss will challenge her more than any arena she faced in The Hunger Games.',29.326803,'/t4TSwsjETzsQiSz0Xhix31YxNXU.jpg','undefined','2015-11-19'),(135397,'Jurassic World','undefined','Twenty-two years after the events of Jurassic Park, Isla Nublar now features a fully functioning dinosaur theme park, Jurassic World, as originally envisioned by John Hammond.',32.071476,'/jjBgi2r5cRt36xF6iNUEhzscEcb.jpg','undefined','2015-06-12'),(138843,'The Conjuring','undefined','Paranormal investigators Ed and Lorraine Warren work to help a family terrorized by a dark presence in their farmhouse. Forced to confront a powerful entity, the Warrens find themselves caught in the most terrifying case of their lives.',5.199576,'/xYGkdhOEVoFrLNUotuTXemtQAWd.jpg','undefined','2013-07-19'),(140607,'Star Wars: Episode VII - The Force Awakens','undefined','A continuation of the saga created by George Lucas, set thirty years after Star Wars: Episode VI – Return of the Jedi.',11.770997,'/fYzpM9GmpBlIC893fNjoWCwE24H.jpg','undefined','2015-12-18'),(150540,'Inside Out','undefined','Growing up can be a bumpy road, and it\'s no exception for Riley, who is uprooted from her Midwest life when her father starts a new job in San Francisco. Like all of us, Riley is guided by her emotions - Joy, Fear, Anger, Disgust and Sadness. The emotions live in Headquarters, the control center inside Riley\'s mind, where they help advise her through everyday life. As Riley and her emotions struggle to adjust to a new life in San Francisco, turmoil ensues in Headquarters. Although Joy, Riley\'s main and most important emotion, tries to keep things positive, the emotions conflict on how best to navigate a new city, house and school.',17.373245,'/aAmfIX3TT40zUHGcCKrlOZRKC7u.jpg','undefined','2015-06-19'),(150689,'Cinderella','undefined','When her father unexpectedly passes away, young Ella finds herself at the mercy of her cruel stepmother and her daughters. Never one to give up hope, Ella\'s fortunes begin to change after meeting a dashing stranger in the woods.',8.032003,'/2i0JH5WqYFqki7WDhUW56Sg0obh.jpg','undefined','2015-03-13'),(152532,'Dallas Buyers Club','undefined','Loosely based on the true-life tale of Ron Woodroof, a drug-taking, women-loving, homophobic man who in 1986 was diagnosed with HIV/AIDS and given thirty days to live.',2.926321,'/aoxYci1HnJdb4bno2jYSnzSGDkL.jpg','undefined','2013-11-22'),(152601,'Her','undefined','In the not so distant future, Theodore, a lonely writer purchases a newly developed operating system designed to meet the user\'s every needs. To Theordore\'s surprise, a romantic relationship develops between him and his operating system. This unconventional love story blends science fiction and romance in a sweet tale that explores the nature of love and the ways that technology isolates and connects us all.',4.62847,'/fsoTLnUXEUTNuVCBxAJMY0HPPd.jpg','undefined','2013-12-18'),(152760,'The Monuments Men','undefined','Based on the true story of the greatest treasure hunt in history, The Monuments Men is an action drama focusing on seven over-the-hill, out-of-shape museum directors, artists, architects, curators, and art historians who went to the front lines of WWII to rescue the world’s artistic masterpieces from Nazi thieves and return them to their rightful owners.  With the art hidden behind enemy lines, how could these guys hope to succeed?',2.752144,'/buKyrMjMaK78uFdZAbp5Wg3Eveq.jpg','undefined','2014-02-20'),(156022,'The Equalizer','undefined','In The Equalizer, Denzel Washington plays McCall, a man who believes he has put his mysterious past behind him and dedicated himself to beginning a new, quiet life. But when McCall meets Teri (Chloë Grace Moretz), a young girl under the control of ultra-violent Russian gangsters, he can’t stand idly by – he has to help her. Armed with hidden skills that allow him to serve vengeance against anyone who would brutalize the helpless, McCall comes out of his self-imposed retirement and finds his desire for justice reawakened. If someone has a problem, if the odds are stacked against them, if they have nowhere else to turn, McCall will help. He is The Equalizer.',6.127787,'/2eQfjqlvPAxd9aLDs8DvsKLnfed.jpg','undefined','2014-09-26'),(157336,'Interstellar','undefined','Interstellar chronicles the adventures of a group of explorers who make use of a newly discovered wormhole to surpass the limitations on human space travel and conquer the vast distances involved in an interstellar voyage.',18.781553,'/nBNZadXqJSdt05SHLqgT0HuC5Gm.jpg','undefined','2014-11-05'),(159824,'Hotel Transylvania 2','undefined','When the old-old-old-fashioned vampire Vlad arrives at the hotel for an impromptu family get-together, Hotel Transylvania is in for a collision of supernatural old-school and modern day cool.',5.762613,'/t4PLWexbe4wbNydCOBv18cYexup.jpg','undefined','2015-09-25'),(166424,'Fantastic Four','undefined','Four young outsiders teleport to a dangerous universe, which alters their physical form in shocking ways. Their lives irrevocably upended, the team must learn to harness their daunting new abilities and work together to save Earth from a former friend turned enemy.',30.583388,'/g23cs30dCMiG4ldaoVNP1ucjs6.jpg','undefined','2015-08-07'),(168259,'Furious 7','undefined','Deckard Shaw seeks revenge against Dominic Toretto and his family for his comatose brother.',12.009272,'/dCgm7efXDmiABSdWDHBDBx2jwmn.jpg','undefined','2015-04-03'),(169917,'A Walk Among the Tombstones','undefined','Private investigator Matthew Scudder is hired by a drug kingpin to find out who kidnapped and murdered his wife.',4.701538,'/xxe77USOk2tPnq7G4cL42gf1OxQ.jpg','undefined','2014-09-19'),(174751,'Jane Got a Gun','undefined','After her outlaw husband returns home shot with eight bullets and barely alive, Jane reluctantly reaches out to an ex-lover who she hasn\'t seen in over ten years to help her defend her farm when the time comes that her husband\'s gang eventually tracks him down to finish the job.',3.077561,'/lEzkD49SZSqv4gkfkv2CqLJ5hx9.jpg','undefined','2015-11-25'),(177572,'Big Hero 6','undefined','The special bond that develops between plus-sized inflatable robot Baymax, and prodigy Hiro Hamada, who team up with a group of friends to form a band of high-tech heroes.',11.134441,'/3zQvuSAUdC3mrx9vnSEpkFX0968.jpg','undefined','2014-11-07'),(177677,'Mission: Impossible – Rogue Nation','undefined','Ethan and team take on their most impossible mission yet, eradicating the Syndicate - an International rogue organization as highly skilled as they are, committed to destroying the IMF.',16.451543,'/z2sJd1OvAGZLxgjBdSnQoLCfn3M.jpg','undefined','2015-07-31'),(181533,'Night at the Museum: Secret of the Tomb','undefined','When the magic powers of The Tablet of Ahkmenrah begin to die out, Larry Daley (Ben Stiller) spans the globe, uniting favorite and new characters while embarking on an epic quest to save the magic before it is gone forever.',6.300871,'/tWwASv4CU1Au1IukacdSUewDCV3.jpg','undefined','2014-12-19'),(188161,'A Million Ways to Die in the West','undefined','As a cowardly farmer begins to fall for the mysterious new woman in town, he must put his new-found courage to the test when her husband, a notorious gun-slinger, announces his arrival.',2.727337,'/12fqfvUmBOPg2pA0RsEhc31P28O.jpg','undefined','2014-05-30'),(190859,'American Sniper','undefined','U.S. Navy SEAL Chris Kyle (Bradley Cooper) takes his sole mission—protect his comrades—to heart and becomes one of the most lethal snipers in American history. His pinpoint accuracy not only saves countless lives but also makes him a prime target of insurgents. Despite grave danger and his struggle to be a good husband and father to his family back in the States, Kyle serves four tours of duty in Iraq. However, when he finally returns home, he finds that he cannot leave the war behind.',7.361005,'/svPHnYE7N5NAGO49dBmRhq0vDQ3.jpg','undefined','2014-12-25'),(194662,'Birdman','undefined','A fading actor best known for his portrayal of a popular superhero attempts to mount a comeback by appearing in a Broadway play. As opening night approaches, his attempts to become more altruistic, rebuild his career, and reconnect with friends and family prove more difficult than expected.',8.172748,'/rSZs93P0LLxqlVEbI001UKoeCQC.jpg','undefined','2014-10-17'),(198277,'Begin Again','undefined','Gretta\'s celebrity boyfriend breaks up with her after a long-term relationship, leaving the singer to find success on her own. With the help of record producer, Dan and hip-hop celebrity, Trouble Gum, Gretta strives to fulfil her musical ambitions.',2.661669,'/og7KVMqGTFaCNPmGVetxtR30Q0z.jpg','undefined','2014-06-27'),(201088,'Blackhat','undefined','A man is released from prison to help American and Chinese authorities pursue a mysterious cyber criminal. The dangerous search leads them from Chicago to Hong Kong.',5.8473,'/sW3VEsulmxMlOmQwm0h7H7lZROi.jpg','undefined','2015-01-16'),(203801,'The Man from U.N.C.L.E.','undefined','At the height of the Cold War, a mysterious criminal organization plans to use nuclear weapons and technology to upset the fragile balance of power between the United States and Soviet Union. CIA agent Napoleon Solo and KGB agent Illya Kuryakin are forced to put aside their hostilities and work together to stop the evildoers in their tracks. The duo\'s only lead is the daughter of a missing German scientist, whom they must find soon to prevent a global catastrophe.',13.697469,'/5ttOaThDVmTpV8iragbrhdfxEep.jpg','undefined','2015-08-14'),(205321,'Sharknado','undefined','A freak hurricane hits Los Angeles, causing man-eating sharks to be scooped up in tornadoes and flooding the city with shark-infested seawater. Surfer and bar-owner Fin sets out with his friends Baz and Nova to rescue his estranged wife April and teenage daughter Claudia',1.616785,'/fhjfcjNBY8FcyxR8hRZ2H19zN6Z.jpg','undefined','2013-07-11'),(205596,'The Imitation Game','undefined','Based on the real life story of legendary cryptanalyst Alan Turing, the film portrays the nail-biting race against time by Turing and his brilliant team of code-breakers at Britain\'s top-secret Government Code and Cypher School at Bletchley Park, during the darkest days of World War II.',9.618156,'/noUp0XOqIcmgefRnRZa1nhtRvWO.jpg','undefined','2014-11-14'),(206647,'Spectre','undefined','A cryptic message from Bond’s past sends him on a trail to uncover a sinister organization. While M battles political forces to keep the secret service alive, Bond peels back the layers of deceit to reveal the terrible truth behind SPECTRE.',44.448812,'/mSvpKOWbyFtLro9BjfEGqUw5dXE.jpg','undefined','2015-10-26'),(207703,'Kingsman: The Secret Service','undefined','Kingsman: The Secret Service tells the story of a super-secret spy organization that recruits an unrefined but promising street kid into the agency\'s ultra-competitive training program just as a global threat emerges from a twisted tech genius.',9.303411,'/8x7ej0LnHdKUqilNNJXYOeyB6L9.jpg','undefined','2015-01-13'),(210577,'Gone Girl','undefined','With his wife\'s disappearance having become the focus of an intense media circus, a man sees the spotlight turned on him when it\'s suspected that he may not be innocent.',10.230017,'/gdiLTof3rbPDAmPaCf4g6op46bj.jpg','undefined','2014-10-03'),(211672,'Minions','undefined','Minions Stuart, Kevin and Bob are recruited by Scarlet Overkill, a super-villain who, alongside her inventor husband Herb, hatches a plot to take over the world.',27.697673,'/q0R4crx2SehcEEQEkYObktdeFy.jpg','undefined','2015-07-10'),(214756,'Ted 2','undefined','Newlywed couple Ted and Tami-Lynn want to have a baby, but in order to qualify to be a parent, Ted will have to prove he\'s a person in a court of law.',21.116012,'/A7HtCxFe7Ms8H7e7o2zawppbuDT.jpg','undefined','2015-06-26'),(216015,'Fifty Shades of Grey','undefined','When college senior Anastasia Steele steps in for her sick roommate to interview prominent businessman Christian Grey for their campus paper, little does she realize the path her life will take. Christian, as enigmatic as he is rich and powerful, finds himself strangely drawn to Ana, and she to him. Though sexually inexperienced, Ana plunges headlong into an affair -- and learns that Christian\'s true sexual proclivities push the boundaries of pain and pleasure.',5.498836,'/jV8wnk3Jgz6f7degmT3lHNGI2tK.jpg','undefined','2015-02-13'),(222935,'The Fault in Our Stars','undefined','Despite the tumor-shrinking medical miracle that has bought her a few years, Hazel has never been anything but terminal, her final chapter inscribed upon diagnosis. But when a patient named Augustus Waters suddenly appears at Cancer Kid Support Group, Hazel\'s story is about to be completely rewritten.',4.677,'/sc6XLX6J714LDkVV3Ys3clgypQS.jpg','undefined','2014-05-16'),(223485,'Slow West','undefined','In the Old West, a 17-year-old Scottish boy teams up with a mysterious gunman to find the woman with whom he is infatuated.',2.044264,'/uZ9dBBn0GaEw0YIBvQd01Io3pho.jpg','undefined','2015-04-16'),(224141,'Into the Woods','undefined','A witch conspires to teach important lessons to various characters of popular children\'s stories including Little Red Riding Hood, Cinderella, Jack and the Beanstalk and Rapunzel.',2.771855,'/5h91odPFNlBuJbRBj5N4MEBfXDE.jpg','undefined','2014-12-25'),(227306,'Unbroken','undefined','A chronicle of the life of Louis Zamperini, an Olympic runner who was taken prisoner by Japanese forces during World War II.',3.79737,'/qvRHvtjNfvq0R0IwV2oVmW6DduS.jpg','undefined','2014-12-25'),(227973,'The Peanuts Movie','undefined','Snoopy embarks upon his greatest mission as he and his team take to the skies to pursue their arch-nemesis, while his best pal Charlie Brown begins his own epic quest back home.',4.380724,'/zF6WpDC7fYTx2pqUYUet06buYmB.jpg','undefined','2015-11-06'),(228066,'Victor Frankenstein','undefined','Eccentric scientist Victor Von Frankenstein creates a grotesque creature in an unorthodox scientific experiment.',6.174056,'/FDcYYHd6IlKj2ZitO9ASE4GlKa.jpg','undefined','2015-11-26'),(238615,'Self/less','undefined','An extremely wealthy elderly man dying from cancer undergoes a radical medical procedure that transfers his consciousness to the body of a healthy young man but everything may not be as good as it seems when he starts to uncover the mystery of the body\'s origins and the secret organization that will kill to keep its secrets.',11.330033,'/tjASt1toIaWxjlMwgFXxPfkIoA4.jpg','undefined','2015-07-10'),(238636,'The Purge: Anarchy','undefined','Three groups of people are trying to survive Purge Night, when their stories intertwine and are left stranded in The Purge trying to survive the chaos and violence that occurs.',3.902958,'/l1DRl40x2OWUoPP42v8fjKdS1Z3.jpg','undefined','2014-07-17'),(238713,'Spy','undefined','A desk-bound CIA analyst volunteers to go undercover to infiltrate the world of a deadly arms dealer, and prevent diabolical global disaster.',6.134851,'/gCBw0AQDhlo0bNetkjsSRWzrxpW.jpg','undefined','2015-06-05'),(241554,'Run All Night','undefined','Brooklyn mobster and prolific hit man Jimmy Conlon, once known as The Gravedigger, has seen better days. Longtime best friend of a mob boss, Jimmy, now 55, is haunted by the sins of his past—as well as a dogged police detective who’s been one step behind Jimmy for 30 years. But when Jimmy’s estranged son becomes a target, Jimmy must make a choice between the crime family he chose and the real family he abandoned long ago. Now, with nowhere safe to turn, Jimmy has just one night to figure out exactly where his loyalties lie and to see if he can finally make things right.',4.619537,'/aqNJrAxudMRNo8jg3HOUQqdl2xr.jpg','undefined','2015-03-13'),(242582,'Nightcrawler','undefined','A driven young man (Gyllenhaal) stumbles upon the underground world of L.A. freelance crime journalism.  When Lou Bloom, desperate for work, muscles into the world of L.A. crime journalism, he blurs the line between observer and participant to become the star of his own story. Aiding him in his effort is Nina, a TV-news veteran.',8.813868,'/fukWJhLISH7f6cnYSdgb0JrSP2Q.jpg','undefined','2014-10-31'),(243683,'Step Up All In','undefined','All-stars from the previous Step Up installments come together in glittering Las Vegas, battling for a victory that could define their dreams and their careers.',3.145716,'/jFkvtmhE4NqENI4e0sZxmI8vrSS.jpg','undefined','2014-07-25'),(243688,'Poltergeist','undefined','Legendary filmmaker Sam Raimi and director Gil Kenan reimagine and contemporize the classic tale about a family whose suburban home is invaded by angry spirits. When the terrifying apparitions escalate their attacks and take the youngest daughter, the family must come together to rescue her.',5.601477,'/fWOPN0XBvHXFYr3RsPr74qBge2I.jpg','undefined','2015-05-22'),(244786,'Whiplash','undefined','Under the direction of a ruthless instructor, a talented young drummer begins to pursue perfection at any cost, even his humanity.',9.211378,'/lIv1QinFqz4dlp5U4lQ6HaiskOZ.jpg','undefined','2014-10-10'),(245891,'John Wick','undefined','After the sudden death of his beloved wife, John Wick receives one last gift from her, a beagle puppy named Daisy, and a note imploring him not to forget how to love. But John\'s mourning is interrupted when his 1969 Boss Mustang catches the eye of sadistic thug Iosef Tarasov who breaks into his house and steals it, beating John unconscious in the process. Unwittingly, he has just reawakened one of the most brutal assassins the underworld has ever known.',10.563975,'/5vHssUeVe25bMrof1HyaPyWgaP.jpg','undefined','2014-10-24'),(249070,'Hitman: Agent 47','undefined','An assassin teams up with a woman to help her find her father and uncover the mysteries of her ancestry.',8.697852,'/4VmZeT8YkuMI6BrA623mHZDISlN.jpg','undefined','2015-08-21'),(254128,'San Andreas','undefined','In the aftermath of a massive earthquake in California, a rescue-chopper pilot makes a dangerous journey across the state in order to rescue his estranged daughter.',16.256174,'/qey0tdcOp9kCDdEZuJ87yE3crSe.jpg','undefined','2015-05-29'),(254470,'Pitch Perfect 2','undefined','The Bellas are back, and they are better than ever. After being humiliated in front of none other than the President of the United States of America, the Bellas are taken out of the Aca-Circuit. In order to clear their name, and regain their status, the Bellas take on a seemingly impossible task: winning an international competition no American team has ever won. In order to accomplish this monumental task, they need to strengthen the bonds of friendship and sisterhood and blow away the competition with their amazing aca-magic! With all new friends and old rivals tagging along for the trip, the Bellas can hopefully accomplish their dreams.',8.832117,'/qSjruLiFB4uqRtz2xheQPxG8uaB.jpg','undefined','2015-05-15'),(256591,'Focus','undefined','A veteran grifter takes a young, attractive woman under his wing, but things get complicated when they become romantically involved.',5.874951,'/9IElGiLkxPLUWZ3avy31bNSG3Tq.jpg','undefined','2015-02-27'),(256835,'Toy Story That Time Forgot','undefined','During a post-Christmas play date, the gang find themselves in uncharted territory when the coolest set of action figures ever turn out to be dangerously delusional. It\'s all up to Trixie, the triceratops, if the gang hopes to return to Bonnie\'s room in this Toy Story That Time Forgot.',2.357495,'/aGDVBwpxlA95mn7yTxwM8r0oTR0.jpg','undefined','2014-12-02'),(257344,'Pixels','undefined','Video game experts are recruited by the military to fight 1980s-era video game characters who\'ve attacked New York.',15.24435,'/ktyVmIqfoaJ8w0gDSZyjhhOPpD6.jpg','undefined','2015-07-24'),(260346,'Taken 3','undefined','Ex-government operative Bryan Mills finds his life is shattered when he\'s falsely accused of a murder that hits close to home. As he\'s pursued by a savvy police inspector, Mills employs his particular set of skills to track the real killer and exact his unique brand of justice.',8.843514,'/ikDwR3i2bczqnRf1urJTy77YTFf.jpg','undefined','2015-01-09'),(261392,'American Ultra','undefined','American Ultra is a fast-paced action comedy about Mike, a seemingly hapless and unmotivated stoner whose small-town life with his live-in girlfriend, Phoebe, is suddenly turned upside down.  Unbeknownst to him, Mike is actually a highly trained, lethal sleeper agent. In the blink of an eye, as his secret past comes back to haunt him, Mike is thrust into the middle of a deadly government operation and is forced to summon his inner action-hero in order to survive.',9.940962,'/auQHgr1FO6upJpXx1eYEeyq2sMs.jpg','undefined','2015-08-21'),(262500,'Insurgent','undefined','Beatrice Prior must confront her inner demons and continue her fight against a powerful alliance which threatens to tear her society apart.',12.789509,'/aBBQSC8ZECGn6Wh92gKDOakSC8p.jpg','undefined','2015-03-20'),(263472,'Knock Knock','undefined','When a devoted husband and father is left home alone for the weekend, two stranded young women unexpectedly knock on his door for help. What starts out as a kind gesture results in a dangerous seduction and a deadly game of cat and mouse.',3.528964,'/eynMtjBB1fXsB5vsQylVmsDLmvw.jpg','undefined','2015-06-26'),(264656,'The Homesman','undefined','When three women living on the edge of the American frontier are driven mad by harsh pioneer life, the task of saving them falls to the pious, independent-minded Mary Bee Cuddy. Transporting the women by covered wagon to Iowa, she soon realizes just how daunting the journey will be, and employs a low-life drifter, George Briggs, to join her. The unlikely pair and the three women head east, where a waiting minister and his wife have offered to take the women in. But the group first must traverse the harsh Nebraska Territories marked by stark beauty, psychological peril and constant threat.',2.150152,'/wzOzeuWYIlRq7Eus1TWnHtYo304.jpg','undefined','2014-08-29'),(264660,'Ex Machina','undefined','Caleb, a 24 year old coder at the world\'s largest internet company, wins a competition to spend a week at a private mountain retreat belonging to Nathan, the reclusive CEO of the company. But when Caleb arrives at the remote location he finds that he will have to participate in a strange and fascinating experiment in which he must interact with the world\'s first true artificial intelligence, housed in the body of a beautiful robot girl.',6.998739,'/btbRB7BrD887j5NrvjxceRDmaot.jpg','undefined','2015-01-21'),(264999,'Magic Mike XXL','undefined','Three years after Mike bowed out of the stripper life at the top of his game, he and the remaining Kings of Tampa hit the road to Myrtle Beach to put on one last blow-out performance.',3.771523,'/lwPpcIeVG1VQJT3JAf2gN4tOyEj.jpg','undefined','2015-07-01'),(265208,'Wild Card','undefined','When a Las Vegas bodyguard with lethal skills and a gambling problem gets in trouble with the mob, he has one last play… and it\'s all or nothing.',6.250619,'/cZMjg5fWkhJ1D7MouzZuiB16Hdk.jpg','undefined','2015-01-30'),(270303,'It Follows','undefined','For 19-year-old Jay, fall should be about school, boys and weekends out at the lake. But after a seemingly innocent physical encounter, she finds herself plagued by strange visions and the inescapable sense that someone, or something, is following her. Faced with this burden, Jay and her teenage friends must find a way to escape the horrors that seem to be only a few steps behind.',7.497054,'/4MrwJZr0R9LbyOgZqwLNmtzzxbu.jpg','undefined','2015-03-13'),(270946,'Penguins of Madagascar','undefined','Skipper, Kowalski, Rico and Private join forces with undercover organization The North Wind to stop the villainous Dr. Octavius Brine from destroying the world as we know it.',6.135583,'/pRer59eyY4rjkLPeKXKo7fPxCHH.jpg','undefined','2014-11-26'),(271718,'Trainwreck','undefined','Having thought that monogamy was never possible, a commitment-phobic career woman may have to face her fears when she meets a good guy.',8.481537,'/e5jbaEiWYHtstuHPHl3lGPoRs4c.jpg','undefined','2015-07-17'),(274854,'The Last Witch Hunter','undefined','The modern world holds many secrets, but by far the most astounding is that witches still live among us; vicious supernatural creatures intent on unleashing the Black Death upon the world and putting an end to the human race once and for all. Armies of witch hunters have battled this unnatural enemy for centuries, including Kaulder, a valiant warrior who many years ago slayed the all-powerful Witch Queen, decimating her followers in the process. In the moments right before her death, the Queen cursed Kaulder with immortality, forever separating him from his beloved wife and daughter. Today, Kaulder is the last living hunter who has spent his immortal life tracking down rogue witches, all the while yearning for his long-lost family.',10.666645,'/xw1GFKzxjgfm3dQoK1swFcHmfaC.jpg','undefined','2015-10-21'),(275601,'Ricki and the Flash','undefined','Meryl Streep stars as Ricki Rendazzo, a guitar heroine who made a world of mistakes as she followed her dreams of rock-and-roll stardom. Returning home, Ricki gets a shot at redemption and a chance to make things right as she faces the music with her family.',2.880572,'/aAEze9iEijSPYATn8ge4jC4AIp4.jpg','undefined','2015-08-07'),(277216,'Straight Outta Compton','undefined','In 1987, five young men, using brutally honest rhymes and hardcore beats, put their frustration and anger about life in the most dangerous place in America into the most powerful weapon they had: their music. Taking us back to where it all began, Straight Outta Compton tells the true story of how these cultural rebels-armed only with their lyrics, swagger, bravado and raw talent-stood up to the authorities that meant to keep them down and formed the world\'s most dangerous group, N.W.A. And as they spoke the truth that no one had before and exposed life in the hood, their voice ignited a social revolution that is still reverberating today. Straight Outta Compton stars O’Shea Jackson Jr., Corey Hawkins and Jason Mitchell as Ice Cube, Dr. Dre and Eazy-E, and is directed by F. Gary Gray.',4.180541,'/X7S1RtotXOZNV7OlgCfh5VKZSB.jpg','undefined','2015-08-14'),(277685,'Unfriended','undefined','While video chatting one night, six high school friends receive a Skype message from a classmate who killed herself exactly one year ago. A first they think it\'s a prank, but when the girl starts revealing the friends\' darkest secrets, they realize they are dealing with something out of this world, something that wants them dead. Told entirely from a young girl\'s computer desktop, Unfriended redefines \'found footage\' for a new generation of teens.',3.713611,'/hfEBlhvVWFt61EWjNbjlKdDilBI.jpg','undefined','2015-06-24'),(280092,'Insidious: Chapter 3','undefined','A twisted new tale of terror begins for a teenage girl and her family, predating the haunting of the Lambert family in the earlier movies and revealing more mysteries of the otherworldly realm The Further.',4.207027,'/ixANIbPRTNMAstlqJa2FlfBesyQ.jpg','undefined','2015-06-05'),(280996,'Mr. Holmes','undefined','The story is set in 1947, following a long-retired Holmes living in a Sussex village with his housekeeper and rising detective son. But then he finds himself haunted by an unsolved 50-year old case. Holmes\' memory isn\'t what it used to be, so he only remembers fragments of the case: a confrontation with an angry husband, a secret bond with his beautiful but unstable wife.',6.815701,'/9v25BUcPSxRS3yJ2yd3GHZOtoS8.jpg','undefined','2015-07-17'),(286217,'The Martian','undefined','During a manned mission to Mars, Astronaut Mark Watney is presumed dead after a fierce storm and left behind by his crew. But Watney has survived and finds himself stranded and alone on the hostile planet. With only meager supplies, he must draw upon his ingenuity, wit and spirit to subsist and find a way to signal to Earth that he is alive.',14.763096,'/5aGhaIHYuQbqlHWvWYqMCnj40y2.jpg','undefined','2015-10-02'),(286565,'Paper Towns','undefined','Quentin Jacobsen has spent a lifetime loving the magnificently adventurous Margo Roth Spiegelman from afar. So when she cracks open a window and climbs back into his life-dressed like a ninja and summoning him for an ingenious campaign of revenge-he follows. After their all-nighter ends and a new day breaks, Q arrives at school to discover that Margo, always an enigma, has now become a mystery. But Q soon learns that there are clues-and they\'re for him. Urged down a disconnected path, the closer he gets, the less Q sees of the girl he thought he knew.',4.882561,'/mIYVDgnzx6Y0f1bSx50cPiBTc2t.jpg','undefined','2015-07-24'),(287424,'Maggie','undefined','There\'s a deadly zombie epidemic threatening humanity, but Wade, a small-town farmer and family man, refuses to accept defeat even when his daughter Maggie becomes infected. As Maggie\'s condition worsens and the authorities seek to eradicate those with the virus, Wade is pushed to the limits in an effort to protect her. Joely Richardson co-stars in this post-apocalyptic thriller.',3.971567,'/mFt7Oo3pf8f1BZAdWLyUpYM63aT.jpg','undefined','2015-05-08'),(287903,'Krampus','undefined','A horror comedy based on the ancient legend about a pagan creature who punishes children on Christmas.',3.421524,'/fMrnNeTMHoCcW2zPmBI53l70zSK.jpg','undefined','2015-12-04'),(287948,'The Transporter Refueled','undefined','The fast-paced action movie is again set in the criminal underworld in France, where Frank Martin (Skrein) is known as The Transporter, because he is the best driver and mercenary money can buy. In this installment, he meets Anna (Chabanol) and they attempt to take down a group of ruthless Russian human traffickers who also have kidnapped Frank’s father.',9.049257,'/zW7oC3tucYLzu77xNbPbYjXUN4o.jpg','undefined','2015-09-04'),(290382,'Roger Waters The Wall','undefined','A concert film that the former Pink Floyd singer-songwriter made on various tour dates between 2010 and 2013, when he was playing his former group\'s 1980 double-album in its entirety.',2.59551,'/yrinwMkY5LC3PAjVpEnL289DW26.jpg','undefined','2014-09-29'),(293310,'Citizenfour','undefined','In June 2013, Laura Poitras and reporter Glenn Greenwald flew to Hong Kong for the first of many meetings with Edward Snowden. She brought her camera with her. The film that resulted from this series of tense encounters is absolutely sui generis in the history of cinema:  a 100% real-life thriller unfolding minute by minute before our eyes. Poitras is a great and brave filmmaker, but she is also a masterful storyteller: she compresses the many days of questioning, waiting, confirming, watching the world’s reaction and agonizing over the next move, into both a great character study of Snowden and a narrative that will leave you on the edge of your seat as it inexorably moves toward its conclusion.',1.959091,'/yNuLhb2y6I5cO7BfiJ7bdfllnIG.jpg','undefined','2014-10-10'),(293646,'The 33','undefined','Based on a true story about the collapse at the mine in San Jose, Chile that  left 33 miners isolated underground for 69 days.',6.368175,'/cQ21yxf5seYrGzjFmMzCkX9PHa2.jpg','undefined','2015-11-13'),(293863,'The Age of Adaline','undefined','After 29-year-old Adaline recovers from a nearly lethal accident, she inexplicably stops growing older. As the years stretch on and on, Adaline keeps her secret to herself  until she meets a man who changes her life.',7.076876,'/gEDGROZ4NQDlRjUPPSSyIf0hKvD.jpg','undefined','2015-04-24'),(294254,'Maze Runner: The Scorch Trials','undefined','Thomas and his fellow Gladers face their greatest challenge yet: searching for clues about the mysterious and powerful organization known as WCKD. Their journey takes them to the Scorch, a desolate landscape filled with unimaginable obstacles. Teaming up with resistance fighters, the Gladers take on WCKD’s vastly superior forces and uncover its shocking plans for them all.',21.140779,'/vlTPQANjLYTebzFJM1G4KeON0cb.jpg','undefined','2015-09-18'),(294963,'Bone Tomahawk','undefined','Four men set out in the Wild West to rescue a group of captives from cannibalistic cave dwellers.',2.216666,'/3DDUneU8wCF3Y8SPUnZTXHoFzJh.jpg','undefined','2015-10-23'),(296099,'Vacation','undefined','Hoping to bring his family closer together and to recreate his childhood vacation for his own kids, a grown up Rusty Griswold takes his wife and their two sons on a cross-country road trip to the coolest theme park in America, Walley World. Needless to say, things don\'t go quite as planned.',6.521301,'/q9kL9WW0Uu4AcfTi5iCLcYzBgnm.jpg','undefined','2015-07-29'),(296100,'The Night Before','undefined','In New York City for their annual tradition of Christmas Eve debauchery, three lifelong best friends set out to find the Holy Grail of Christmas parties since their yearly reunion might be coming to an end.',6.439937,'/eEGZgNZgN3sZWwoSaL1u2rTGlzj.jpg','undefined','2015-11-25'),(304410,'The Bélier Family','undefined','The whole Bélier family is deaf, except for sixteen year old Paula who is the important translator in her parents\' day to day life especially when it comes to matters concerning the family farm. When her music teacher discovers she has a fantastic singing voice and she gets an opportunity to enter a big Radio France contest the whole family\'s future is set up for big changes.',2.454526,'/6AvypOYzbDnoFMpdSH63gzWTxAr.jpg','undefined','2014-12-17'),(309809,'The Little Prince','undefined','Based on the best-seller book \'The little prince\', the movie tells the story of a little girl that lives with resignation in a world where efficiency and work are the only dogmas. Everything will change when accidentally she discovers her neighbor that will tell her about the story of the Little Prince that he once met.',4.887005,'/uUNd8rVnHxhl2DOtaU7itT2vv78.jpg','undefined','2015-07-29'),(312221,'Creed','undefined','The former World Heavyweight Champion Rocky Balboa serves as a trainer and mentor to Adonis Johnson, the son of his late friend and former rival Apollo Creed.',7.510121,'/xSE4NBFDzqedwa4AIj99r1Z7ljF.jpg','undefined','2015-11-25'),(318224,'Going Clear: Scientology and the Prison of Belief','undefined','Going Clear intimately profiles eight former members of the Church of Scientology, shining a light on how they attract true believers and the things they do in the name of religion.',1.879114,'/jSPtAWXKd4NFJInCiA653bxdf8L.jpg','undefined','2015-01-25'),(331781,'Amy','undefined','A documentary on the late singer/songwriter, who died of alcohol poisoning in 2011.',2.684551,'/9MSvswdjiwPzinPXraY6Y7UQglS.jpg','undefined','2015-07-03'),(333696,'Naked Among Wolves','undefined','Naked Among Wolves (German: Nackt unter Wölfen) is a German drama film directed by Philipp Kadelbach in 2015. It is based on the novel of the same name by Bruno Apitz, which was published in 1958 by the East German Publishing house. It was created for television, it is the third film version of the literary text. The film takes place in the years 1944 and 1945 towards the end of World War II in the Buchenwald concentration camp.',3.042991,'/daEWegR9Vm3LnLfEeOo0uh7zoUf.jpg','undefined','2015-04-01'),(334074,'Survivor','undefined','A Foreign Service Officer in London tries to prevent a terrorist attack set to hit New York, but is forced to go on the run when she is framed for crimes she did not commit.',6.644921,'/XtvR1aSph7X3wqrE2PY66IPzVi.jpg','undefined','2015-05-29'),(339543,'Northpole: Open for Christmas','undefined','A successful businesswoman, Mackenzie, inherits her beloved aunt\'s inn, and chooses to restore the hotel to its original grandeur only to sell it right before Christmas. Unbeknownst to Mackenzie, she receives some unexpected help from a team of elves headed by the cheerful Clementine, who helps Mackenzie rediscover the true meaning of Christmas.',2.139,'/wLNL2PFdio25MLukmZ6EXZIbsD6.jpg','undefined','2015-11-21'),(348150,'Jim Henson’s Turkey Hollow','undefined','Jim Henson’s Turkey Hollow follows a family who goes on a hunt for a Bigfoot-like creature called the Howling Hoodoo during a visit to the house of their kooky aunt (played by Last Man on Earth’s Mary Steenburgen). The Howling Hoodoo itself is difficult to find, but they come across some other monsters in the woods that they didn’t even know they were looking for.',1.939579,'/xZ3VuYltswsY5gTp33u2zCCdDNP.jpg','undefined','2015-11-21'),(348634,'A Christmas Detour','undefined','With Christmas only a few days away, Paige Summerland, a Los Angeles magazine writer specializing in relationship advice, boards an eastbound flight to spend the holiday with her fiancé, Jack, meet his parents for the first time and plan her upcoming “dream wedding.” Paige’s enthusiasm turns to panic when a massive snowstorm detours her flight and she meets - and locks horns with - Dylan, a cynical bar manager who has lost his faith in love. When it looks like all hope of arriving in New York for Christmas is lost, Dylan surprises Paige by renting an SUV and offering her a ride. Reluctantly, Paige braves the snowy road trip with Dylan, joined by Frank and Maxine Harper, an older couple whose 20-year marriage has lost its spark. Along the journey, feelings start to develop between Paige and Dylan. Now, as the young bride-to-be scrambles to make it to New York for Christmas, she begins to wonder if she’s marrying the right man and just might learn a surprising lesson about love.',1.893186,'/tk0nIZDHy7UrZ9ZncvNoUqkZlpy.jpg','undefined','2015-12-01'),(359807,'Chico - Artista Brasileiro','undefined','null',2.023649,'/f29mfeVpVxa4FSCu2WfVFNr10eS.jpg','undefined','2015-11-26'),(359983,'The Lion Guard: Return of the Roar','undefined','Set in the African savannah, the film follows Kion as he assembles the members of the \'Lion Guard\'. Throughout the film, the diverse team of young animals will learn how to utilize each of their unique abilities to solve problems and accomplish tasks to maintain balance within the Circle of Life, while also introducing viewers to the vast array of animals that populate the prodigious African landscape.',2.292133,'/jLqd4MZltZlS0P4jcWMgBPgXeiA.jpg','undefined','2015-11-22'),(360603,'Crown for Christmas','undefined','After getting fired from her job as a maid at a ritzy New York City hotel, Allie reluctantly accepts a temp gig as the governess to a young girl who is part of a powerful family in Europe that lives in an actual castle. After arriving, Allie learns the girl is named Princess Theodora and her father is Maximillion, the King of Winshire. The King informs Allie that the Princess has a tendency to terrorize authority figures, a predilection that has grown worse since her mother’s death. Yet governess and Princess wind up hitting it off while at the same time a spark forms between Allie and Max. However, Countess Celia is expecting to wed the King. Will Max take a stand for his feelings for Allie and make it truly a merry Christmas for all (or at least, most)?',2.63226,'/d5v34mY5G4TYQnDHfPC5r7TAWPq.jpg','undefined','2015-11-27'),(360604,'Ice Sculpture Christmas','undefined','After starting her first job at a country club restaurant, Callie – an aspiring chef – reconnects with her childhood friend David, whose wealthy family is a member of the club. When David enters Callie into the club’s annual Christmas ice sculpting competition without her knowledge, she’s forced to go head-to-head with her boss, Chef Gloria. Even though ice sculpting is cold work, sparks are ignited between Callie and David as they prepare for the competition as a team. Callie’s passions for cooking and ice sculpting are met with romance and Christmas spirit as she works to create the perfect sculpture.',2.44489,'/1Mk13IqiV6nMbgLKcMzAho5Y7kj.jpg','undefined','2015-11-26'),(361751,'Murder She Baked: A Plum Pudding Murder Mystery','undefined','A young bakeshop owner’s holiday season takes a surprising turn when she finds a body at a local Christmas tree lot and winds up involved in a dangerous murder investigation. With colorful characters popping up as suspects, shady business practices uncovered at the tree lot and holiday romance in the air, the young baker-turned-sleuth must race against time to track down the killer and save the Christmas season.',1.751688,'/rQLqdDYaksAnYGDBn6cjTTbth3Q.jpg','undefined','2015-11-22'),(361931,'Ronaldo','undefined','Filmed over 14 months with unprecedented access into the inner circle of the man and the sport, this is the first official and fully authorised film of one of the most celebrated figures in football.  For the first time ever, the world gets vividly candid and un-paralleled, behind-closed-doors access to the footballer, father, family-man and friend in this moving &amp; fascinating documentary. Through in-depth conversations, state of the art football footage and never before seen archival footage, the film gives an astonishing insight into the sporting and personal life of triple Ballon D\'Or winner Cristiano Ronaldo at the peak of his career.  From the makers of ‘Senna’ and ‘Amy’, Ronaldo takes audiences on an intimate and revealing journey of what it’s like to live as an iconic athlete in the eye of the storm.',2.090181,'/kW5J5u5a7J4MtZi8CNAyFT6nUoJ.jpg','undefined','2015-11-09'),(362883,'My One Christmas Wish','undefined','Jackie Turner is a straight-A college student, who was abused, abandoned and starved as a child. Although she has resolutely turned her life around, the holidays are still very painful for her. Facing another lonely holiday break on campus, Jackie takes an ad on Craigslist for My ONE CHRISTMAS Wish - a family for Christmas - and even offers to pay $8 an hour. To her surprise, responses flood in. Among the numerous heartfelt invitations and letters of support, she also hears from other young people struggling with the same overwhelming emptiness that comes with spending the holidays without loved ones. Moved and inspired, Jackie decides to throw a big Christmas party - with the last-minute help of her adviser, friends and support group - to find families for all those troubled folks who emailed her, and finds one for herself as well.',2.233302,'/jpiKoBXsgkgeMvMkP4EJlW82HDQ.jpg','undefined','2015-11-29'),(367960,'The Spymasters - CIA in the Crosshairs','undefined','Documentary revealing the inner workings of the world\'s most powerful intelligence organization, with unprecedented access to America\'s spy network, all 12 living CIA directors and top agency operatives, who talk candidly about torture, secret prisons, drone warfare, alleged assassinations and the constant threat of attack, which begs the question: how far should America go to keep us safe?',2.596099,'null','undefined','2015-11-28'),(369385,'De man van Pruimenbloesem','undefined','null',2.135579,'null','undefined','2015-11-27'),(369533,'Adele at the BBC','undefined','In this one-off BBC Music exclusive celebrating the release of her new album 25, Adele performs some of her world-famous classic tracks, as well as eagerly awaited new material, accompanied by her band in front of a live studio audience. Plus host Graham Norton talks to Adele about her career and extraordinary life to date. There\'s also some fun to be had as Adele gets up close and personal with some of her biggest fans. The show includes Adele\'s first television performance of Skyfall since the 85th Academy Awards in February 2013, where she won Best Original Song for the theme music to the 23rd James Bond film.  Broadcast on BBC One on 20 November, 2015.',1.999504,'/mwbeE2oBHlwqszLIq65FaDoLTH.jpg','undefined','2015-11-20'),(370089,'De un tiempo libre a esta parte','undefined','null',2.02632,'null','undefined','2015-11-26'),(370132,'virocrypsis','undefined','Cynthia and Celinde are two and one. They share the same space, inhabit the same bodily form, in a perennial embrace, yet have separate personas. Located in the surfaces and membranes of the visual, virocrypsis displays their desires, identities and gestures.',2.12626,'null','undefined','2015-11-26'),(370173,'Unsichtbare Jahre','undefined','null',1.87266,'/zyXBDUVTQ6dRFHujRP5LztcwXdw.jpg','undefined','2015-11-25'),(370244,'André\'s Eyes','undefined','ANDRÉ\'S EYES is an experimental docudrama in which the actual family members themselves participate in the recreation of their own story. Set in a small village in the Portuguese countryside, the film follows the struggle of a divorced father to keep his family together after his youngest son is taken away from them and placed in a foster family.',1.43304,'/xx1BwN3iW37keXZbGtYIek6WUpI.jpg','undefined','2015-11-27'),(370355,'Transition','undefined','Natalie Berry is one of the UK’s leading female sport and competition climbers. Despite having lived in Scotland all her life, home to some of the best traditional and winter climbing in the world, she has yet to venture into the mountains so close to home. ‘Transition’ follows Natalie over the course of a year as she takes her first exploratory steps into a new world, closely following the highs and lows of the pursuit of a life in the mountains.',2.5699,'/sVoWtwWzmfCIMwomBAgXTGklIeL.jpg','undefined','2015-11-28'),(370381,'Bullets for the Dead','undefined','A hardened bounty hunter, a gang of outlaws in his trust and a preacher are forced to work together and battle their way across the old west of the 1870s when the zombie apocalypse begins.',4,'/85S2jnkKZytTe63tCtBsrlOTs0r.jpg','undefined','2015-11-29');
