INSERT INTO `popular` VALUES (11,'Star Wars: Episode IV - A New Hope','Princess Leia is captured and held hostage by the evil Imperial forces in their effort to take over the galactic Empire. Venturesome Luke Skywalker and dashing captain Han Solo team together with the loveable robot duo R2-D2 and C-3PO to rescue the beautiful princess and restore peace and justice in the Empire.',9.48778,'/tvSlBzAdRE29bZe5yYWrJ2ds137.jpg','1977-05-25'),(120,'The Lord of the Rings: The Fellowship of the Ring','Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.',6.958026,'/bxVxZb5O9OxCO0oRUNdCnpy9NST.jpg','2001-12-19'),(278,'The Shawshank Redemption','Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.',6.758459,'/9O7gLzmreU0nGkIB6K3BsJbzvNv.jpg','1994-09-14'),(280,'Terminator 2: Judgment Day','Nearly 10 years have passed since Sarah Connor was targeted for termination by a cyborg from the future. Now her son, John, the future leader of the resistance, is the target for a newer, more deadly terminator. Once again, the resistance has managed to send a protector back to attempt to save John and his mother Sarah.',5.940231,'/2y4dmgWYRMYXdD1UyJVcn2HSd1D.jpg','1991-07-01'),(296,'Terminator 3: Rise of the Machines','It\'s been 10 years since John Connor saved Earth from Judgment Day, and he\'s now living under the radar, steering clear of using anything Skynet can trace. That is, until he encounters T-X, a robotic assassin ordered to finish what T-1000 started. Good thing Connor\'s former nemesis, the Terminator, is back to aid the now-adult Connor … just like he promised.',8.92864,'/lz4xYdF1n09lyiCfZWtWT44SZiG.jpg','2003-06-30'),(534,'Terminator Salvation','All grown up in post-apocalyptic 2018, John Connor must lead the resistance of humans against the increasingly dominating militaristic robots. But when Marcus Wright appears, his existence confuses the mission as Connor tries to determine whether Wright has come from the future or the past -- and whether he\'s friend or foe.',13.496506,'/hxDfhavtxA2Ayx7O9BsQMcZRdG0.jpg','2009-05-20'),(603,'The Matrix','Thomas A. Anderson is a man living two lives. By day he is an average computer programmer and by night a malevolent hacker known as Neo, who finds himself targeted by the police when he is contacted by Morpheus, a legendary computer hacker, who reveals the shocking truth about our reality.',6.777108,'/lZpWprJqbIFpEV5uoHfoK0KCnTW.jpg','1999-03-30'),(812,'Aladdin','Princess Jasmine grows tired of being forced to remain in the palace and she sneaks out into the marketplace  in disguise where she meets street-urchin Aladdin and the two fall in love, although she may only marry a prince. After being thrown in jail, Aladdin and becomes embroiled in a plot to find a mysterious lamp with which the evil Jafar hopes to rule the land.',6.963967,'/qsHpmqekgeQKMKL8PWnFsrXTXGs.jpg','1992-11-25'),(1726,'Iron Man','Tony Stark. Genius, billionaire, playboy, philanthropist. Son of legendary inventor and weapons contractor Howard Stark. When Tony Stark is assigned to give a weapons presentation to an Iraqi unit led by Lt. Col. James Rhodes, he\'s given a ride on enemy lines. That ride ends badly when Stark\'s Humvee that he\'s riding in is attacked by enemy combatants. He survives - barely - with a chest full of shrapnel and a car battery attached to his heart. In order to survive he comes up with a way to miniaturize the battery and figures out that the battery can power something else. Thus Iron Man is born. He uses the primitive device to escape from the cave in Iraq. Once back home, he then begins work on perfecting the Iron Man suit. But the man who was put in charge of Stark Industries has plans of his own to take over Tony\'s technology for other matters.',6.745632,'/848chlIWVT41VtAAgyh9bWymAYb.jpg','2008-05-02'),(1771,'Captain America: The First Avenger','Predominantly set during World War II, Steve Rogers is a sickly man from Brooklyn who\'s transformed into super-soldier Captain America to aid in the war effort. Rogers must stop the Red Skull – Adolf Hitler\'s ruthless head of weaponry, and the leader of an organization that intends to use a mysterious device of untold powers for world domination.',10.37753,'/dlIPGXPxXQTp9kFrRzn0RsfUelx.jpg','2011-07-22'),(1891,'Star Wars: Episode V - The Empire Strikes Back','The epic saga continues as Luke Skywalker, in hopes of defeating the evil Galactic Empire, learns the ways of the Jedi from aging master Yoda. But Darth Vader is more determined than ever to capture Luke. Meanwhile, rebel leader Princess Leia, cocky Han Solo, Chewbacca, and droids C-3PO and R2-D2 are thrown into various stages of capture, betrayal and despair.',6.646107,'/6u1fYtxG5eqjhtCPDx04pJphQRW.jpg','1980-05-17'),(1892,'Star Wars: Episode VI - Return of the Jedi','As Rebel leaders map their strategy for an all-out attack on the Emperor\'s newer, bigger Death Star. Han Solo remains frozen in the cavernous desert fortress of Jabba the Hutt, the most loathsome outlaw in the universe, who is also keeping Princess Leia as a slave girl. Now a master of the Force, Luke Skywalker rescues his friends, but he cannot become a true Jedi Knight until he wages his own crucial battle against Darth Vader, who has sworn to win Luke over to the dark side of the Force.',6.92386,'/jx5p0aHlbPXqe3AH9G15NvmWaqQ.jpg','1983-05-25'),(1893,'Star Wars: Episode I - The Phantom Menace','Anakin Skywalker, a young slave strong with the Force, is discovered on Tatooine. Meanwhile, the evil Sith have returned, enacting their plot for revenge against the Jedi.',6.223965,'/n8V09dDc02KsSN6Q4hC2BX6hN8X.jpg','1999-05-19'),(1894,'Star Wars: Episode II - Attack of the Clones','Ten years after the invasion of Naboo, the galaxy is on the brink of civil war. Under the leadership of a renegade Jedi named Count Dooku, thousands of solar systems threaten to break away from the Galactic Republic. When an assassination attempt is made on Senator Padmé Amidala, the former Queen of Naboo, twenty-year-old Jedi apprentice Anakin Skywalker is assigned to protect her. In the course of his mission, Anakin discovers his love for Padmé as well as his own darker side. Soon, Anakin, Padmé, and Obi-Wan Kenobi are drawn into the heart of the Separatist movement and the beginning of the Clone Wars.',7.586113,'/2vcNFtrZXNwIcBgH5e2xXCmVR8t.jpg','2002-05-16'),(1895,'Star Wars: Episode III - Revenge of the Sith','Years after the onset of the Clone Wars, the noble Jedi Knights lead a massive clone army into a galaxy-wide battle against the Separatists. When the sinister Sith unveil a thousand-year-old plot to rule the galaxy, the Republic crumbles and from its ashes rises the evil Galactic Empire. Jedi hero Anakin Skywalker is seduced by the dark side of the Force to become the Emperor\'s new apprentice -- Darth Vader. The Jedi are decimated, as Obi-Wan Kenobi and Jedi Master Yoda are forced into hiding. The only hope for the galaxy are Anakin\'s own offspring -- the twin children born in secrecy who will grow up to become heroes.',5.610095,'/tgr5Pdy7ehZYBqBkN2K7Q02xgOb.jpg','2005-05-19'),(10195,'Thor','Against his father Odin\'s will, The Mighty Thor -a powerful but arrogant warrior god -recklessly reignites an ancient war. Thor is cast down to Earth and forced to live among humans as punishment. Once here, Thor learns what it takes to be a true hero when the most dangerous villain of his world sends the darkest forces of Asgard to invade Earth.',5.843095,'/bIuOWTtyFPjsFDevqvF3QrD1aun.jpg','2011-05-06'),(11135,'The Rescuers Down Under','A lawless poacher wants to capture a majestic and rare golden eagle, so he kidnaps the boy who knows where to find the bird. Not to worry -- the Rescue Aid Society\'s top agents, heroic mice Miss Bianca and Bernard, fly to Australia to save the day. Accompanying the fearless duo are bumbling albatross Wilbur and local field operative Jake the Kangaroo Rat.',13.416328,'/vweXLAZP6E55EaMeedndhBdXQGu.jpg','1990-11-16'),(13590,'Eddie Izzard: Glorious','Eddie Izzard\'s routine has a loose trajectory from the beginning of the Old Testament and the creation of the world in seven days to Revelations. Along the way, we learn of the search for a career, bad giraffes, Prince Philip\'s gaffes, toilets in French campsites, the mysteries of hopscotch, becoming one\'s Dad and tranny bashing.',17.830872,'/ub8d4LNtfwfibUclk89KDNQJx5k.jpg','1997-11-17'),(19995,'Avatar','In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien civilization.',8.323943,'/tcqb9NHdw9SWs2a88KCDD4V8sVR.jpg','2009-12-18'),(24428,'The Avengers','When an unexpected enemy emerges and threatens global safety and security, Nick Fury, director of the international peacekeeping agency known as S.H.I.E.L.D., finds himself in need of a team to pull the world back from the brink of disaster. Spanning the globe, a daring recruitment effort begins!',8.965819,'/cezWGskPY5x7GaglTTRN4Fugfb8.jpg','2012-05-04'),(37724,'Skyfall','When Bond\'s latest assignment goes gravely wrong and agents around the world are exposed, MI6 is attacked forcing M to relocate the agency. These events cause her authority and position to be challenged by Gareth Mallory (Ralph Fiennes), the new Chairman of the Intelligence and Security Committee. With MI6 now compromised from both inside and out, M is left with one ally she can trust: Bond. 007 takes to the shadows - aided only by field agent, Eve (Naomie Harris) - following a trail to the mysterious Silva (Javier Bardem), whose lethal and hidden motives have yet to reveal themselves.',7.917999,'/uVALAeLEMGMf3oYpvdVi4uuaNOo.jpg','2012-11-09'),(49047,'Gravity','Dr. Ryan Stone (Sandra Bullock), a brilliant medical engineer on her first Shuttle mission, with veteran astronaut Matt Kowalsky (George Clooney) in command of his last flight before retiring. But on a seemingly routine spacewalk, disaster strikes. The Shuttle is destroyed, leaving Stone and Kowalsky completely alone-tethered to nothing but each other and spiraling out into the blackness of space. The deafening silence tells them they have lost any link to Earth and any chance for rescue. As fear turns to panic, every gulp of air eats away at what little oxygen is left. But the only way home may be to go further out into the terrifying expance of space…',5.670649,'/uPxtxhB2Fy9ihVqtBtNGHmknJqV.jpg','2013-10-04'),(49051,'The Hobbit: An Unexpected Journey','Bilbo Baggins, a hobbit enjoying his quiet life, is swept into an epic quest by Gandalf the Grey and thirteen dwarves who seek to reclaim their mountain home from Smaug, the dragon.',7.226012,'/w29Guo6FX6fxzH86f8iAbEhQEFC.jpg','2012-12-14'),(57158,'The Hobbit: The Desolation of Smaug','The Dwarves, Bilbo and Gandalf have successfully escaped the Misty Mountains, and Bilbo has gained the One Ring. They all continue their journey to get their gold back from the Dragon, Smaug.',7.333217,'/gQCiuxGsfiXH1su6lp9n0nd0UeH.jpg','2013-12-13'),(68718,'Django Unchained','With the help of a German bounty hunter, a freed slave sets out to rescue his wife from a brutal Mississippi plantation owner.',6.679332,'/5WJnxuw41sddupf8cwOxYftuvJG.jpg','2012-12-25'),(68721,'Iron Man 3','The brash-but-brilliant industrialist Tony Stark faces an enemy whose reach knows no bounds. When Stark finds his personal world destroyed at his enemy’s hands, he embarks on a harrowing quest to find those responsible. This journey, at every turn, will test his mettle. With his back against the wall, Stark is left to survive by his own devices, relying on his ingenuity and instincts to protect those closest to him. As he fights his way back, Stark discovers the answer to the question that has secretly haunted him: does the man make the suit or does the suit make the man?',6.5349,'/1Ilv6ryHUv6rt9zIsbSEJUmmbEi.jpg','2013-05-03'),(76338,'Thor: The Dark World','Thor fights to restore order across the cosmos… but an ancient race led by the vengeful Malekith returns to plunge the universe back into darkness. Faced with an enemy that even Odin and Asgard cannot withstand, Thor must embark on his most perilous and personal journey yet, one that will reunite him with Jane Foster and force him to sacrifice everything to save us all.',6.791771,'/6t3KOEUtrIPmmtu1czzt6p2XxJy.jpg','2013-11-08'),(76341,'Mad Max: Fury Road','An apocalyptic story set in the furthest reaches of our planet, in a stark desert landscape where humanity is broken, and most everyone is crazed fighting for the necessities of life. Within this world exist two rebels on the run who just might be able to restore order. There\'s Max, a man of action and a man of few words, who seeks peace of mind following the loss of his wife and child in the aftermath of the chaos. And Furiosa, a woman of action and a woman who believes her path to survival may be achieved if she can make it across the desert back to her childhood homeland.',19.78455,'/kqjL17yufvn9OVLyXYpvtyrFfak.jpg','2015-05-15'),(76757,'Jupiter Ascending','In a universe where human genetic material is the most precious commodity, an impoverished young Earth woman becomes the key to strategic maneuvers and internal strife within a powerful dynasty…',8.996824,'/aMEsvTUklw0uZ3gk3Q6lAj6302a.jpg','2015-02-05'),(87101,'Terminator Genisys','The year is 2029. John Connor, leader of the resistance continues the war against the machines. At the Los Angeles offensive, John\'s fears of the unknown future begin to emerge when TECOM spies reveal a new plot by SkyNet that will attack him from both fronts; past and future, and will ultimately change warfare forever.',32.692379,'/5JU9ytZJyR3zmClGmVm9q4Geqbd.jpg','2015-07-01'),(98566,'Teenage Mutant Ninja Turtles','The city needs heroes. Darkness has settled over New York City as Shredder and his evil Foot Clan have an iron grip on everything from the police to the politicians. The future is grim until four unlikely outcast brothers rise from the sewers and discover their destiny as Teenage Mutant Ninja Turtles. The Turtles must work with fearless reporter April and her wise-cracking cameraman Vern Fenwick to save the city and unravel Shredder\'s diabolical plan.',9.429455,'/oDL2ryJ0sV2bmjgshVgJb3qzvwp.jpg','2014-08-08'),(99861,'Avengers: Age of Ultron','When Tony Stark tries to jumpstart a dormant peacekeeping program, things go awry and Earth’s Mightiest Heroes are put to the ultimate test as the fate of the planet hangs in the balance. As the villainous Ultron emerges, it is up to The Avengers to stop him from enacting his terrible plans, and soon uneasy alliances and unexpected action pave the way for an epic and unique global adventure.',14.091396,'/t90Y3G8UGQp0f0DrP60wRu9gfrH.jpg','2015-05-01'),(100402,'Captain America: The Winter Soldier','After the cataclysmic events in New York with The Avengers, Steve Rogers, aka Captain America is living quietly in Washington, D.C. and trying to adjust to the modern world. But when a S.H.I.E.L.D. colleague comes under attack, Steve becomes embroiled in a web of intrigue that threatens to put the world at risk. Joining forces with the Black Widow, Captain America struggles to expose the ever-widening conspiracy while fighting off professional assassins sent to silence him at every turn. When the full scope of the villainous plot is revealed, Captain America and the Black Widow enlist the help of a new ally, the Falcon. However, they soon find themselves up against an unexpected and formidable enemy—the Winter Soldier.',11.901272,'/5TQ6YDmymBpnF005OyoB7ohZps9.jpg','2014-04-04'),(102899,'Ant-Man','Armed with the astonishing ability to shrink in scale but increase in strength, con-man Scott Lang must embrace his inner-hero and help his mentor, Dr. Hank Pym, protect the secret behind his spectacular Ant-Man suit from a new generation of towering threats. Against seemingly insurmountable obstacles, Pym and Lang must plan and pull off a heist that will save the world.',84.211344,'/D6e8RJf2qUstnfkTslTXNTUAlT.jpg','2015-08-14'),(105864,'The Good Dinosaur','An epic journey into the world of dinosaurs where an Apatosaurus named Arlo makes an unlikely human friend.',11.833813,'/2ZckiMTfSkCep2JTtZbr73tnQbN.jpg','2015-11-25'),(109445,'Frozen','Young princess Anna of Arendelle dreams about finding true love at her sister Elsa’s coronation. Fate takes her on a dangerous journey in an attempt to end the eternal winter that has fallen over the kingdom. She\'s accompanied by ice delivery man Kristoff, his reindeer Sven, and snowman Olaf. On an adventure where she will find out what friendship, courage, family, and true love really means.',7.721492,'/jIjdFXKUNtdf1bwqMrhearpyjMj.jpg','2013-11-27'),(116741,'The Internship','Two recently laid-off men in their 40s try to make it as interns at a successful Internet company where their managers are in their 20s.',14.18289,'/xxOKDTQbQo7h1h7TyrQIW7u8KcJ.jpg','2013-06-07'),(118340,'Guardians of the Galaxy','Light years from Earth, 26 years after being abducted, Peter Quill finds himself the prime target of a manhunt after discovering an orb wanted by Ronan the Accuser.',11.586127,'/y31QB9kn3XSudA15tV7UWQ9XLuW.jpg','2014-08-01'),(119450,'Dawn of the Planet of the Apes','A group of scientists in San Francisco struggle to stay alive in the aftermath of a plague that is wiping out humanity, while Caesar tries to maintain dominance over his community of intelligent apes.',5.496703,'/2EUAUIu5lHFlkj5FRryohlH6CRO.jpg','2014-07-11'),(127585,'X-Men: Days of Future Past','The ultimate X-Men ensemble fights a war for the survival of the species across two time periods as they join forces with their younger selves in an epic battle that must change the past – to save our future.',8.278466,'/qKkFk9HELmABpcPoc1HHZGIxQ5a.jpg','2014-05-23'),(131631,'The Hunger Games: Mockingjay - Part 1','Katniss Everdeen reluctantly becomes the symbol of a mass rebellion against the autocratic Capitol.',22.653188,'/cWERd8rgbw7bCMZlwP207HUXxym.jpg','2014-11-20'),(131634,'The Hunger Games: Mockingjay - Part 2','With the nation of Panem in a full scale war, Katniss confronts President Snow in the final showdown. Teamed with a group of her closest friends – including Gale, Finnick, and Peeta – Katniss goes off on a mission with the unit from District 13 as they risk their lives to stage an assassination attempt on President Snow who has become increasingly obsessed with destroying her. The mortal traps, enemies, and moral choices that await Katniss will challenge her more than any arena she faced in The Hunger Games.',32.760674,'/t4TSwsjETzsQiSz0Xhix31YxNXU.jpg','2015-11-19'),(135397,'Jurassic World','Twenty-two years after the events of Jurassic Park, Isla Nublar now features a fully functioning dinosaur theme park, Jurassic World, as originally envisioned by John Hammond.',31.745822,'/jjBgi2r5cRt36xF6iNUEhzscEcb.jpg','2015-06-12'),(140607,'Star Wars: Episode VII - The Force Awakens','A continuation of the saga created by George Lucas, set thirty years after Star Wars: Episode VI – Return of the Jedi.',11.066421,'/fYzpM9GmpBlIC893fNjoWCwE24H.jpg','2015-12-18'),(147441,'Exodus: Gods and Kings','The defiant leader Moses rises up against the Egyptian Pharaoh Ramses, setting 600,000 slaves on a monumental journey of escape from Egypt and its terrifying cycle of deadly plagues.',8.169702,'/tCN8NXset4NQ5qU0uBxqKOM0r5r.jpg','2014-12-12'),(150540,'Inside Out','Growing up can be a bumpy road, and it\'s no exception for Riley, who is uprooted from her Midwest life when her father starts a new job in San Francisco. Like all of us, Riley is guided by her emotions - Joy, Fear, Anger, Disgust and Sadness. The emotions live in Headquarters, the control center inside Riley\'s mind, where they help advise her through everyday life. As Riley and her emotions struggle to adjust to a new life in San Francisco, turmoil ensues in Headquarters. Although Joy, Riley\'s main and most important emotion, tries to keep things positive, the emotions conflict on how best to navigate a new city, house and school.',20.184606,'/aAmfIX3TT40zUHGcCKrlOZRKC7u.jpg','2015-06-19'),(150689,'Cinderella','When her father unexpectedly passes away, young Ella finds herself at the mercy of her cruel stepmother and her daughters. Never one to give up hope, Ella\'s fortunes begin to change after meeting a dashing stranger in the woods.',8.144988,'/2i0JH5WqYFqki7WDhUW56Sg0obh.jpg','2015-03-13'),(157336,'Interstellar','Interstellar chronicles the adventures of a group of explorers who make use of a newly discovered wormhole to surpass the limitations on human space travel and conquer the vast distances involved in an interstellar voyage.',21.692574,'/nBNZadXqJSdt05SHLqgT0HuC5Gm.jpg','2014-11-05'),(159824,'Hotel Transylvania 2','When the old-old-old-fashioned vampire Vlad arrives at the hotel for an impromptu family get-together, Hotel Transylvania is in for a collision of supernatural old-school and modern day cool.',8.18449,'/t4PLWexbe4wbNydCOBv18cYexup.jpg','2015-09-25'),(166424,'Fantastic Four','Four young outsiders teleport to a dangerous universe, which alters their physical form in shocking ways. Their lives irrevocably upended, the team must learn to harness their daunting new abilities and work together to save Earth from a former friend turned enemy.',21.062459,'/g23cs30dCMiG4ldaoVNP1ucjs6.jpg','2015-08-07'),(168259,'Furious 7','Deckard Shaw seeks revenge against Dominic Toretto and his family for his comatose brother.',11.026426,'/dCgm7efXDmiABSdWDHBDBx2jwmn.jpg','2015-04-03'),(177572,'Big Hero 6','The special bond that develops between plus-sized inflatable robot Baymax, and prodigy Hiro Hamada, who team up with a group of friends to form a band of high-tech heroes.',12.931577,'/3zQvuSAUdC3mrx9vnSEpkFX0968.jpg','2014-11-07'),(177677,'Mission: Impossible – Rogue Nation','Ethan and team take on their most impossible mission yet, eradicating the Syndicate - an International rogue organization as highly skilled as they are, committed to destroying the IMF.',22.696703,'/z2sJd1OvAGZLxgjBdSnQoLCfn3M.jpg','2015-07-31'),(181533,'Night at the Museum: Secret of the Tomb','When the magic powers of The Tablet of Ahkmenrah begin to die out, Larry Daley (Ben Stiller) spans the globe, uniting favorite and new characters while embarking on an epic quest to save the magic before it is gone forever.',8.188912,'/tWwASv4CU1Au1IukacdSUewDCV3.jpg','2014-12-19'),(190859,'American Sniper','U.S. Navy SEAL Chris Kyle (Bradley Cooper) takes his sole mission—protect his comrades—to heart and becomes one of the most lethal snipers in American history. His pinpoint accuracy not only saves countless lives but also makes him a prime target of insurgents. Despite grave danger and his struggle to be a good husband and father to his family back in the States, Kyle serves four tours of duty in Iraq. However, when he finally returns home, he finds that he cannot leave the war behind.',5.920219,'/svPHnYE7N5NAGO49dBmRhq0vDQ3.jpg','2014-12-25'),(192141,'No Escape','In their new overseas home, an American family soon finds themselves caught in the middle of a coup, and they frantically look for a safe escape in an environment where foreigners are being immediately executed.',8.866643,'/rAXjFWgZY6rhZYLxLHCk8uzK4QG.jpg','2015-08-26'),(194662,'Birdman','A fading actor best known for his portrayal of a popular superhero attempts to mount a comeback by appearing in a Broadway play. As opening night approaches, his attempts to become more altruistic, rebuild his career, and reconnect with friends and family prove more difficult than expected.',7.104378,'/rSZs93P0LLxqlVEbI001UKoeCQC.jpg','2014-10-17'),(198184,'Chappie','Every child comes into the world full of promise, and none more so than Chappie: he is gifted, special, a prodigy. Like any child, Chappie will come under the influence of his surroundings—some good, some bad—and he will rely on his heart and soul to find his way in the world and become his own man. But there\'s one thing that makes Chappie different from any one else: he is a robot.',10.903095,'/saF3HtAduvrP9ytXDxSnQJP3oqx.jpg','2015-03-06'),(201088,'Blackhat','A man is released from prison to help American and Chinese authorities pursue a mysterious cyber criminal. The dangerous search leads them from Chicago to Hong Kong.',7.103706,'/sW3VEsulmxMlOmQwm0h7H7lZROi.jpg','2015-01-16'),(203801,'The Man from U.N.C.L.E.','At the height of the Cold War, a mysterious criminal organization plans to use nuclear weapons and technology to upset the fragile balance of power between the United States and Soviet Union. CIA agent Napoleon Solo and KGB agent Illya Kuryakin are forced to put aside their hostilities and work together to stop the evildoers in their tracks. The duo\'s only lead is the daughter of a missing German scientist, whom they must find soon to prevent a global catastrophe.',12.732338,'/5ttOaThDVmTpV8iragbrhdfxEep.jpg','2015-08-14'),(205596,'The Imitation Game','Based on the real life story of legendary cryptanalyst Alan Turing, the film portrays the nail-biting race against time by Turing and his brilliant team of code-breakers at Britain\'s top-secret Government Code and Cypher School at Bletchley Park, during the darkest days of World War II.',10.12269,'/noUp0XOqIcmgefRnRZa1nhtRvWO.jpg','2014-11-14'),(206647,'Spectre','A cryptic message from Bond’s past sends him on a trail to uncover a sinister organization. While M battles political forces to keep the secret service alive, Bond peels back the layers of deceit to reveal the terrible truth behind SPECTRE.',40.171183,'/mSvpKOWbyFtLro9BjfEGqUw5dXE.jpg','2015-10-26'),(207703,'Kingsman: The Secret Service','Kingsman: The Secret Service tells the story of a super-secret spy organization that recruits an unrefined but promising street kid into the agency\'s ultra-competitive training program just as a global threat emerges from a twisted tech genius.',11.635211,'/8x7ej0LnHdKUqilNNJXYOeyB6L9.jpg','2015-01-13'),(210577,'Gone Girl','With his wife\'s disappearance having become the focus of an intense media circus, a man sees the spotlight turned on him when it\'s suspected that he may not be innocent.',8.758643,'/gdiLTof3rbPDAmPaCf4g6op46bj.jpg','2014-10-03'),(211672,'Minions','Minions Stuart, Kevin and Bob are recruited by Scarlet Overkill, a super-villain who, alongside her inventor husband Herb, hatches a plot to take over the world.',29.508245,'/q0R4crx2SehcEEQEkYObktdeFy.jpg','2015-07-10'),(214756,'Ted 2','Newlywed couple Ted and Tami-Lynn want to have a baby, but in order to qualify to be a parent, Ted will have to prove he\'s a person in a court of law.',26.993789,'/A7HtCxFe7Ms8H7e7o2zawppbuDT.jpg','2015-06-26'),(238615,'Self/less','An extremely wealthy elderly man dying from cancer undergoes a radical medical procedure that transfers his consciousness to the body of a healthy young man but everything may not be as good as it seems when he starts to uncover the mystery of the body\'s origins and the secret organization that will kill to keep its secrets.',8.897529,'/tjASt1toIaWxjlMwgFXxPfkIoA4.jpg','2015-07-10'),(238713,'Spy','A desk-bound CIA analyst volunteers to go undercover to infiltrate the world of a deadly arms dealer, and prevent diabolical global disaster.',6.558953,'/gCBw0AQDhlo0bNetkjsSRWzrxpW.jpg','2015-06-05'),(240832,'Lucy','A woman, accidentally caught in a dark deal, turns the tables on her captors and transforms into a merciless warrior evolved beyond human logic.',7.54593,'/rwn876MeqienhOVSSjtUPnwxn0Z.jpg','2014-07-25'),(244786,'Whiplash','Under the direction of a ruthless instructor, a talented young drummer begins to pursue perfection at any cost, even his humanity.',10.722559,'/lIv1QinFqz4dlp5U4lQ6HaiskOZ.jpg','2014-10-10'),(245891,'John Wick','After the sudden death of his beloved wife, John Wick receives one last gift from her, a beagle puppy named Daisy, and a note imploring him not to forget how to love. But John\'s mourning is interrupted when his 1969 Boss Mustang catches the eye of sadistic thug Iosef Tarasov who breaks into his house and steals it, beating John unconscious in the process. Unwittingly, he has just reawakened one of the most brutal assassins the underworld has ever known.',9.292104,'/5vHssUeVe25bMrof1HyaPyWgaP.jpg','2014-10-24'),(249070,'Hitman: Agent 47','An assassin teams up with a woman to help her find her father and uncover the mysteries of her ancestry.',8.914384,'/4VmZeT8YkuMI6BrA623mHZDISlN.jpg','2015-08-21'),(254128,'San Andreas','In the aftermath of a massive earthquake in California, a rescue-chopper pilot makes a dangerous journey across the state in order to rescue his estranged daughter.',17.153901,'/qey0tdcOp9kCDdEZuJ87yE3crSe.jpg','2015-05-29'),(254470,'Pitch Perfect 2','The Bellas are back, and they are better than ever. After being humiliated in front of none other than the President of the United States of America, the Bellas are taken out of the Aca-Circuit. In order to clear their name, and regain their status, the Bellas take on a seemingly impossible task: winning an international competition no American team has ever won. In order to accomplish this monumental task, they need to strengthen the bonds of friendship and sisterhood and blow away the competition with their amazing aca-magic! With all new friends and old rivals tagging along for the trip, the Bellas can hopefully accomplish their dreams.',7.154349,'/qSjruLiFB4uqRtz2xheQPxG8uaB.jpg','2015-05-15'),(257344,'Pixels','Video game experts are recruited by the military to fight 1980s-era video game characters who\'ve attacked New York.',17.376111,'/ktyVmIqfoaJ8w0gDSZyjhhOPpD6.jpg','2015-07-24'),(260346,'Taken 3','Ex-government operative Bryan Mills finds his life is shattered when he\'s falsely accused of a murder that hits close to home. As he\'s pursued by a savvy police inspector, Mills employs his particular set of skills to track the real killer and exact his unique brand of justice.',8.126331,'/ikDwR3i2bczqnRf1urJTy77YTFf.jpg','2015-01-09'),(261392,'American Ultra','American Ultra is a fast-paced action comedy about Mike, a seemingly hapless and unmotivated stoner whose small-town life with his live-in girlfriend, Phoebe, is suddenly turned upside down.  Unbeknownst to him, Mike is actually a highly trained, lethal sleeper agent. In the blink of an eye, as his secret past comes back to haunt him, Mike is thrust into the middle of a deadly government operation and is forced to summon his inner action-hero in order to survive.',8.373883,'/auQHgr1FO6upJpXx1eYEeyq2sMs.jpg','2015-08-21'),(262500,'Insurgent','Beatrice Prior must confront her inner demons and continue her fight against a powerful alliance which threatens to tear her society apart.',11.654417,'/aBBQSC8ZECGn6Wh92gKDOakSC8p.jpg','2015-03-20'),(264660,'Ex Machina','Caleb, a 24 year old coder at the world\'s largest internet company, wins a competition to spend a week at a private mountain retreat belonging to Nathan, the reclusive CEO of the company. But when Caleb arrives at the remote location he finds that he will have to participate in a strange and fascinating experiment in which he must interact with the world\'s first true artificial intelligence, housed in the body of a beautiful robot girl.',5.534568,'/btbRB7BrD887j5NrvjxceRDmaot.jpg','2015-01-21'),(270303,'It Follows','For 19-year-old Jay, fall should be about school, boys and weekends out at the lake. But after a seemingly innocent physical encounter, she finds herself plagued by strange visions and the inescapable sense that someone, or something, is following her. Faced with this burden, Jay and her teenage friends must find a way to escape the horrors that seem to be only a few steps behind.',6.692666,'/4MrwJZr0R9LbyOgZqwLNmtzzxbu.jpg','2015-03-13'),(270946,'Penguins of Madagascar','Skipper, Kowalski, Rico and Private join forces with undercover organization The North Wind to stop the villainous Dr. Octavius Brine from destroying the world as we know it.',7.312333,'/pRer59eyY4rjkLPeKXKo7fPxCHH.jpg','2014-11-26'),(271110,'Captain America: Civil War','Following the events of Age of Ultron, the collective governments of the world pass an act designed to regulate all superhuman activity. This polarizes opinion amongst the Avengers, causing two factions to side with Iron Man or Captain America, which causes an epic battle between former allies',10.034276,'/6vzNCyVNPkcITEMKl3oXnWm8QMs.jpg','2016-05-06'),(271718,'Trainwreck','Having thought that monogamy was never possible, a commitment-phobic career woman may have to face her fears when she meets a good guy.',7.812008,'/e5jbaEiWYHtstuHPHl3lGPoRs4c.jpg','2015-07-17'),(274854,'The Last Witch Hunter','The modern world holds many secrets, but by far the most astounding is that witches still live among us; vicious supernatural creatures intent on unleashing the Black Death upon the world and putting an end to the human race once and for all. Armies of witch hunters have battled this unnatural enemy for centuries, including Kaulder, a valiant warrior who many years ago slayed the all-powerful Witch Queen, decimating her followers in the process. In the moments right before her death, the Queen cursed Kaulder with immortality, forever separating him from his beloved wife and daughter. Today, Kaulder is the last living hunter who has spent his immortal life tracking down rogue witches, all the while yearning for his long-lost family.',11.311141,'/xw1GFKzxjgfm3dQoK1swFcHmfaC.jpg','2015-10-21'),(286217,'The Martian','During a manned mission to Mars, Astronaut Mark Watney is presumed dead after a fierce storm and left behind by his crew. But Watney has survived and finds himself stranded and alone on the hostile planet. With only meager supplies, he must draw upon his ingenuity, wit and spirit to subsist and find a way to signal to Earth that he is alive.',14.583162,'/5aGhaIHYuQbqlHWvWYqMCnj40y2.jpg','2015-10-02'),(286565,'Paper Towns','Quentin Jacobsen has spent a lifetime loving the magnificently adventurous Margo Roth Spiegelman from afar. So when she cracks open a window and climbs back into his life-dressed like a ninja and summoning him for an ingenious campaign of revenge-he follows. After their all-nighter ends and a new day breaks, Q arrives at school to discover that Margo, always an enigma, has now become a mystery. But Q soon learns that there are clues-and they\'re for him. Urged down a disconnected path, the closer he gets, the less Q sees of the girl he thought he knew.',5.90037,'/mIYVDgnzx6Y0f1bSx50cPiBTc2t.jpg','2015-07-24'),(287948,'The Transporter Refueled','The fast-paced action movie is again set in the criminal underworld in France, where Frank Martin (Skrein) is known as The Transporter, because he is the best driver and mercenary money can buy. In this installment, he meets Anna (Chabanol) and they attempt to take down a group of ruthless Russian human traffickers who also have kidnapped Frank’s father.',7.901766,'/zW7oC3tucYLzu77xNbPbYjXUN4o.jpg','2015-09-04'),(294254,'Maze Runner: The Scorch Trials','Thomas and his fellow Gladers face their greatest challenge yet: searching for clues about the mysterious and powerful organization known as WCKD. Their journey takes them to the Scorch, a desolate landscape filled with unimaginable obstacles. Teaming up with resistance fighters, the Gladers take on WCKD’s vastly superior forces and uncover its shocking plans for them all.',17.694721,'/vlTPQANjLYTebzFJM1G4KeON0cb.jpg','2015-09-18'),(296099,'Vacation','Hoping to bring his family closer together and to recreate his childhood vacation for his own kids, a grown up Rusty Griswold takes his wife and their two sons on a cross-country road trip to the coolest theme park in America, Walley World. Needless to say, things don\'t go quite as planned.',8.279581,'/q9kL9WW0Uu4AcfTi5iCLcYzBgnm.jpg','2015-07-29'),(312221,'Creed','The former World Heavyweight Champion Rocky Balboa serves as a trainer and mentor to Adonis Johnson, the son of his late friend and former rival Apollo Creed.',9.948679,'/xSE4NBFDzqedwa4AIj99r1Z7ljF.jpg','2015-11-25');
