INSERT INTO `theatre` VALUES (105864,'The Good Dinosaur','An epic journey into the world of dinosaurs where an Apatosaurus named Arlo makes an unlikely human friend.',11.833813,'/2ZckiMTfSkCep2JTtZbr73tnQbN.jpg','2015-11-25'),(131634,'The Hunger Games: Mockingjay - Part 2','With the nation of Panem in a full scale war, Katniss confronts President Snow in the final showdown. Teamed with a group of her closest friends – including Gale, Finnick, and Peeta – Katniss goes off on a mission with the unit from District 13 as they risk their lives to stage an assassination attempt on President Snow who has become increasingly obsessed with destroying her. The mortal traps, enemies, and moral choices that await Katniss will challenge her more than any arena she faced in The Hunger Games.',32.760674,'/t4TSwsjETzsQiSz0Xhix31YxNXU.jpg','2015-11-19'),(146301,'Paranormal Activity: The Ghost Dimension','Using a special camera that can see spirits, a family must protect their daughter from an evil entity with a sinister plan.',2.25405,'/xvrboSpvjl58UxpK969gQ9W7EMc.jpg','2015-10-22'),(167073,'Brooklyn','In 1950s Ireland and New York, young Ellis Lacey has to choose between two men and two countries.',2.50563,'/yeA0eyNUmMlvXPkm9AHQfzxOwPy.jpg','2015-11-04'),(174751,'Jane Got a Gun','After her outlaw husband returns home shot with eight bullets and barely alive, Jane reluctantly reaches out to an ex-lover who she hasn\'t seen in over ten years to help her defend her farm when the time comes that her husband\'s gang eventually tracks him down to finish the job.',2.682369,'/lEzkD49SZSqv4gkfkv2CqLJ5hx9.jpg','2015-11-25'),(206647,'Spectre','A cryptic message from Bond’s past sends him on a trail to uncover a sinister organization. While M battles political forces to keep the secret service alive, Bond peels back the layers of deceit to reveal the terrible truth behind SPECTRE.',40.171183,'/mSvpKOWbyFtLro9BjfEGqUw5dXE.jpg','2015-10-26'),(227973,'The Peanuts Movie','Snoopy embarks upon his greatest mission as he and his team take to the skies to pursue their arch-nemesis, while his best pal Charlie Brown begins his own epic quest back home.',3.26444,'/zF6WpDC7fYTx2pqUYUet06buYmB.jpg','2015-11-06'),(228066,'Victor Frankenstein','Eccentric scientist Victor Von Frankenstein creates a grotesque creature in an unorthodox scientific experiment.',5.455685,'/FDcYYHd6IlKj2ZitO9ASE4GlKa.jpg','2015-11-26'),(245168,'Suffragette','Based on true events about the foot soldiers of the early feminist movement who were forced underground to evade the State.',1.901544,'/gG2Y8GNXzMrZCx65a8EhdNq2iuu.jpg','2015-10-23'),(258480,'Carol','Set in 1950s New York, a department-store clerk who dreams of a better life falls for an older, married woman.',2.749007,'/AbKa7ANxmui0Jmhh7gV7OSELKIL.jpg','2015-11-20'),(269585,'Psychotropic Sunrise','Following a suicide attempt, 19 year old Lito travels from Monterrey to Querétaro to visit his 20 years old cousin Koko; where he joins his group of friends with the intention of selling drugs to pay for a weekend trip to the beaches of Michoacán. Among psychotropic pills, LSD and mushrooms; among improvised friendships and trips to nature, a bond is created reinforcing their friendship; while Lito seems to find the path towards reconciliation.',1.073898,'/mZsVv3jTNmSZ0qln9W7fMnysYXo.jpg','2015-12-01'),(271736,'The Program','An Irish sports journalist becomes convinced that Lance Armstrong\'s performances during the Tour de France victories are fueled by banned substances. With this conviction, he starts hunting for evidence that will expose Armstrong.',2.160594,'/w8sBqGSko8OBsKbK6z7gPvRfp7F.jpg','2015-11-19'),(274854,'The Last Witch Hunter','The modern world holds many secrets, but by far the most astounding is that witches still live among us; vicious supernatural creatures intent on unleashing the Black Death upon the world and putting an end to the human race once and for all. Armies of witch hunters have battled this unnatural enemy for centuries, including Kaulder, a valiant warrior who many years ago slayed the all-powerful Witch Queen, decimating her followers in the process. In the moments right before her death, the Queen cursed Kaulder with immortality, forever separating him from his beloved wife and daughter. Today, Kaulder is the last living hunter who has spent his immortal life tracking down rogue witches, all the while yearning for his long-lost family.',11.311141,'/xw1GFKzxjgfm3dQoK1swFcHmfaC.jpg','2015-10-21'),(280152,'Vaaliba Raja','Valeba Raja revolves around Raja, a psychiatrist who helps Sethu, a fashion designer, find the right life partner. It shows us what chaos ensues when you ask a shrink to help you find love.',0.955128,'/txUuiUcYjtt4Lz7BdJhBITKuDa.jpg','2015-11-27'),(290751,'Secret in Their Eyes','A tight-knit team of FBI investigators, along with their District Attorney supervisor, is suddenly torn apart when they discover that one of their own teenage daughters has been brutally murdered.',2.268238,'/uvR53Wf6a0BuL1gONgRiyH9Gz5d.jpg','2015-11-20'),(291015,'Under The Dog','An anime science fiction action thriller that will explore what it means to live and die well, testing the limits of all we hold dear.  The year is 2025 in the city of Tokyo Bayside Special District, five years following the devastation wrought by a specially enhanced groups of terrorists at the 2020 Summer Olympics. The UN formed a special covert branch purposed with searching out and eliminating the forces responsible for the attack. The International School for Boys and Girls was established for the covert operation of discovering and recruiting gifted high school students and to coerce them in the service of an elite death squad. There is no choosing sides for these recruits and failure is not an option. Failure on the field assures not only their own, but also their loved ones\' deaths.',1.013219,'/51XOLy9VOV9mrsWMF2esZaqODtb.jpg','2015-12-01'),(293646,'The 33','Based on a true story about the collapse at the mine in San Jose, Chile that  left 33 miners isolated underground for 69 days.',5.843914,'/cQ21yxf5seYrGzjFmMzCkX9PHa2.jpg','2015-11-13'),(294963,'Bone Tomahawk','Four men set out in the Wild West to rescue a group of captives from cannibalistic cave dwellers.',1.990933,'/3DDUneU8wCF3Y8SPUnZTXHoFzJh.jpg','2015-10-23'),(295964,'Burnt','Adam Jones is a Chef who destroyed his career with drugs and diva behavior. He cleans up and returns to London, determined to redeem himself by spearheading a top restaurant that can gain three Michelin stars.',3.178475,'/nF7OxU8DyzmIy5jH6w26Jmavofh.jpg','2015-11-12'),(296100,'The Night Before','In New York City for their annual tradition of Christmas Eve debauchery, three lifelong best friends set out to find the Holy Grail of Christmas parties since their yearly reunion might be coming to an end.',3.183836,'/eEGZgNZgN3sZWwoSaL1u2rTGlzj.jpg','2015-11-25'),(306819,'The Danish Girl','The story of Danish painter Einar Wegener, one of the first recipients of gender reassignment surgery.',3.615691,'/wkzLMkEUBVBh55932K9vPKauObL.jpg','2015-11-27'),(312221,'Creed','The former World Heavyweight Champion Rocky Balboa serves as a trainer and mentor to Adonis Johnson, the son of his late friend and former rival Apollo Creed.',9.948679,'/xSE4NBFDzqedwa4AIj99r1Z7ljF.jpg','2015-11-25'),(318579,'Idhu Namma Aalu','Idhu Namma Aalu is an upcoming Tamil romantic comedy film, directed by Pandiraj and starring Silambarasan and Nayantara in the lead roles. Silambarasan also produces the film, while his brother Kuralarasan makes his debut as a music director.',2.202563,'/ffTT8DzWsUXiqJ4ZV0pTfI93V4a.jpg','2015-11-27'),(323561,'Bad Apple','Bad Apple is the story of Quinn Robinson, a Pastor\'s daughter who learns a valuable life lesson while at Christian Summer Camp. Pastor Robinson and his family are just settling into their new house and new church home. Pastor Robinson is a stern man with a high school sports and military background. His wife Melinda grew up in hard times during her childhood, but as an adult wants to enjoy the finer things in life.',2.074263,'null','2015-12-01'),(323694,'Nina Forever','Holly loves Rob and tries to help him through his grief – even if it means contending with his dead girlfriend Nina, who comes back, bloody and broken, every time they make love',2.847327,'/nswYufoclu1tka560j7hZbrSVmv.jpg','2015-12-01'),(324807,'A Bigger Splash','An American couple, Paul and Marianne, spend their vacation in Italy and and experiences trouble when the wife invites a former lover and his teenage daughter to visit, which leads to jealousy and dangerous sexual scenarios.',2.560602,'/yhCZHxKEC9bIlePfcg3aqPPeKOA.jpg','2015-11-26'),(327253,'The Gracefield Incident','On August 16, 2013, the Supreme Court mandated the CIA to declassify files that had been kept secret for the past 75 years. Visual records of documented paranormal events were released to the public. The following incident took place in Gracefield, Quebec.',2.001676,'/7BfjiYpsHkwyDHGSm5lsKJyum11.jpg','2015-12-01'),(331836,'Babysitting 2','null',1.913305,'/3axegdA2GiT5eoUwlebXSc8lVkP.jpg','2015-12-02'),(332502,'400 Days','4 would be astronauts spend 400 days in a land locked space simulator to test the psychological effects of deep space travel but, when something goes terribly wrong and they are forced to leave the simulation, they discover that everything on earth has changed. Is this real or is the simulation on a higher level than they could have ever imagined?',2.636505,'/nRq4Go8AITgb2efT0B3EKyIlege.jpg','2015-11-12'),(333348,'Love the Coopers','When four generations of the Cooper clan come together for their annual Christmas Eve celebration, a series of unexpected visitors and unlikely events turn the night upside down, leading them all toward a surprising rediscovery of family bonds and the spirit of the holiday.',1.981564,'/nL0rGAxqIT6rBBudFjN8wJDkrVM.jpg','2015-11-12'),(333981,'Creeper','Among the lights and sounds of the city a predator roams night clubs and bars searching for victims for his sexually twisted fantasies. Even people with normal everyday jobs have their secrets that they hide from the rest of the world',1.985296,'/q7CwWi1gW4IJp7nioKNkXtil2v4.jpg','2015-12-01'),(336004,'Heist','A father is without the means to pay for his daughter\'s medical treatment. As a last resort, he partners with a greedy co-worker to rob a casino. When things go awry they\'re forced to hijack a city bus.',2.149388,'/t5tGykRvvlLBULIPsAJEzGg1ylm.jpg','2015-11-13'),(336759,'Gwapa','Gwapa, meaning beautiful in Visayan, is the fitting title of this vibrant, real-life story that follows two Filipino families and their struggle for a healthy future',1.988784,'null','2015-12-01'),(339274,'Tamasha','Tamasha is about the journey of someone who has lost his edge in trying to behave according to socially acceptable conventions of the society. The film is based on the central theme of abrasion and loss of self that happens in an attempt to fit in oneself back.',2.131994,'/2rmd23GlgRHQZbqA98ee3BQTdCQ.jpg','2015-11-27'),(339543,'Northpole: Open for Christmas','A successful businesswoman, Mackenzie, inherits her beloved aunt\'s inn, and chooses to restore the hotel to its original grandeur only to sell it right before Christmas. Unbeknownst to Mackenzie, she receives some unexpected help from a team of elves headed by the cheerful Clementine, who helps Mackenzie rediscover the true meaning of Christmas.',2.583523,'/wLNL2PFdio25MLukmZ6EXZIbsD6.jpg','2015-11-21'),(342061,'Chris Ramsey Live: All Growed Up','The debut live DVD of Chris Ramsey, regular on Celebrity Juice and star of BBC\'s Hebburn. Join Chris as he explores getting older, finding yourself, taking responsibility, realising you are no longer a child and all of the other terrifying realisations that come with being dragged kicking and screaming into modern adulthood.',2.250445,'/bzPTZvcPUAkbA3KzKKRiBHSiMLK.jpg','2015-11-30'),(345454,'Mapla Singam','Mapla Singam is an upcoming Indian Tamil-language romantic comedy film directed by Rajasekhar. Don Ashok has penned the dialogs.',2.024082,'/kbismHCjSiQNR2SEQVbqKlzGcjR.jpg','2015-11-27'),(346616,'Tief durchatmen, die Familie kommt','null',1.01955,'null','2015-12-01'),(348537,'Ocho apellidos catalanes','null',2.182015,'/vkNxDxk89U6Es4YRBMxQ9T5t2zM.jpg','2015-11-20'),(348634,'A Christmas Detour','With Christmas only a few days away, Paige Summerland, a Los Angeles magazine writer specializing in relationship advice, boards an eastbound flight to spend the holiday with her fiancé, Jack, meet his parents for the first time and plan her upcoming “dream wedding.” Paige’s enthusiasm turns to panic when a massive snowstorm detours her flight and she meets - and locks horns with - Dylan, a cynical bar manager who has lost his faith in love. When it looks like all hope of arriving in New York for Christmas is lost, Dylan surprises Paige by renting an SUV and offering her a ride. Reluctantly, Paige braves the snowy road trip with Dylan, joined by Frank and Maxine Harper, an older couple whose 20-year marriage has lost its spark. Along the journey, feelings start to develop between Paige and Dylan. Now, as the young bride-to-be scrambles to make it to New York for Christmas, she begins to wonder if she’s marrying the right man and just might learn a surprising lesson about love.',3.105567,'/tk0nIZDHy7UrZ9ZncvNoUqkZlpy.jpg','2015-12-01'),(355066,'The Bad Cat','Produced by Turkey\'s biggest animation studio, Anima Istanbul, The Bad Cat is an animated epic for young adults featuring the unforgettably bad cat, Shero and his foul mouthed gang in action. As animals inhabiting streets Shero and his friends are after what anyone else in their notoriously sleazy Istanbul neighborhood wants: debauchery with girls, food and the occasional drinking binge. This ordinary looking day will prove otherwise as their paths cross with humans, things get a little out of hand in hilarious, harsh and unexpected ways.  The Bad Cat is an animated 3D feature film that strikes into our heads the epitome of what a bad cat who\'s deprived of love and barbeque is capable of. The story involves a sleazy, sexed up cat Shero, discovers he is the father of a bastard son.',1.179608,'/mdnSGvu7IWfDye27a19U6xqKQgO.jpg','2015-11-27'),(357413,'Wake Up, Girls! Beyond the Bottom','Second movie sequel of Wake Up, Girls!.',2.094558,'/nfkgUpOvFzIRTcBXf9mDzQxIFBB.jpg','2015-12-01'),(357415,'Tamayura Kanketsu-hen Movie 3','The third movie of a four-part finale of Tamayura.',1.207045,'/kybC2T26wiFvRQ9yzjVvS48rpg9.jpg','2015-11-28'),(357422,'Zeit der Reife','null',2.019109,'null','2015-12-01'),(357599,'Russell Kane Live','Multi-award winning comedian, presenter, actor, author and scriptwriter Russell Kane takes to the stage for a live exclusive, one- off performance - with the same energetic, spontaneous and highly articulate performance that he has become synonymous with.',1.217039,'/vXmoUymcQ97cvQEib8HSK4CBJ9Q.jpg','2015-11-30'),(357600,'Dara O Briain - Crowd Tickler','Dara O Briain is one of the most recognisable faces on British TV, as host of Mock The Week, The Apprentice You’re Fired and Star Gazing Live . Not forgetting his most recent shows Dara O Briain: School of Hard Sums for Dave and Dara O Briain’s Science Club for BBC2. Catch one of the most charismatic, intelligent,talking and downright funny live performers working today.',1.977006,'/pWQ96PrNe85b9pdFLXHYfzFrFAT.jpg','2015-11-23'),(357868,'Fluid Boy','An actresses audition for a Zombie Flick goes horribly wrong when she falls into the hands of two deranged males, who disagree on how to make a snuff!!.',2.678396,'/kMLoXLLqBkTuTwjk6aCdSFaiOmY.jpg','2015-11-29'),(360603,'Crown for Christmas','After getting fired from her job as a maid at a ritzy New York City hotel, Allie reluctantly accepts a temp gig as the governess to a young girl who is part of a powerful family in Europe that lives in an actual castle. After arriving, Allie learns the girl is named Princess Theodora and her father is Maximillion, the King of Winshire. The King informs Allie that the Princess has a tendency to terrorize authority figures, a predilection that has grown worse since her mother’s death. Yet governess and Princess wind up hitting it off while at the same time a spark forms between Allie and Max. However, Countess Celia is expecting to wed the King. Will Max take a stand for his feelings for Allie and make it truly a merry Christmas for all (or at least, most)?',2.885055,'/d5v34mY5G4TYQnDHfPC5r7TAWPq.jpg','2015-11-27'),(360604,'Ice Sculpture Christmas','After starting her first job at a country club restaurant, Callie – an aspiring chef – reconnects with her childhood friend David, whose wealthy family is a member of the club. When David enters Callie into the club’s annual Christmas ice sculpting competition without her knowledge, she’s forced to go head-to-head with her boss, Chef Gloria. Even though ice sculpting is cold work, sparks are ignited between Callie and David as they prepare for the competition as a team. Callie’s passions for cooking and ice sculpting are met with romance and Christmas spirit as she works to create the perfect sculpture.',1.997046,'/1Mk13IqiV6nMbgLKcMzAho5Y7kj.jpg','2015-11-26'),(361931,'Ronaldo','Filmed over 14 months with unprecedented access into the inner circle of the man and the sport, this is the first official and fully authorised film of one of the most celebrated figures in football.  For the first time ever, the world gets vividly candid and un-paralleled, behind-closed-doors access to the footballer, father, family-man and friend in this moving &amp; fascinating documentary. Through in-depth conversations, state of the art football footage and never before seen archival footage, the film gives an astonishing insight into the sporting and personal life of triple Ballon D\'Or winner Cristiano Ronaldo at the peak of his career.  From the makers of ‘Senna’ and ‘Amy’, Ronaldo takes audiences on an intimate and revealing journey of what it’s like to live as an iconic athlete in the eye of the storm.',2.190671,'/kW5J5u5a7J4MtZi8CNAyFT6nUoJ.jpg','2015-11-09'),(362883,'My One Christmas Wish','Jackie Turner is a straight-A college student, who was abused, abandoned and starved as a child. Although she has resolutely turned her life around, the holidays are still very painful for her. Facing another lonely holiday break on campus, Jackie takes an ad on Craigslist for My ONE CHRISTMAS Wish - a family for Christmas - and even offers to pay $8 an hour. To her surprise, responses flood in. Among the numerous heartfelt invitations and letters of support, she also hears from other young people struggling with the same overwhelming emptiness that comes with spending the holidays without loved ones. Moved and inspired, Jackie decides to throw a big Christmas party - with the last-minute help of her adviser, friends and support group - to find families for all those troubled folks who emailed her, and finds one for herself as well.',2.539243,'/jpiKoBXsgkgeMvMkP4EJlW82HDQ.jpg','2015-11-29'),(364664,'Lazy Hazy Crazy','Childhood friends Tracy, Chloe and Alice share an apartment over the summer. They live close together, meet guys and sell their company as well as sex.  With a romantic imagery and sometimes provocative theme the female debutant director Luk Yee-sum give the audience a playful story about sexuality, desire and friendship.',5.345551,'/26DGx7WWfiDL1uSGUYx9CQtNnBU.jpg','2015-10-29'),(364748,'The Spot','The Spot is a comedy/drama featuring rapper Gucci Mane. Mr. Boomtown is directing the film. It features appearances from Keyshia Ka’oir, Rocko, OJ Da Juiceman, Young Scooter plus comedians Shawty Shawty and Kelly Walker. This will come with an accompanying soundtrack.',2.227095,'/3NXQq9AHojOvExXHju707hGATFZ.jpg','2015-11-30'),(365651,'Minutes to Midnight','On the cusp of New Year\'s Eve, seven friends and a mysterious backpacker converge at a desolate ski lodge in the mountains when they are systematically hunted down by ruthless masked men with a cryptic agenda.',1.208313,'/plj1C2zHaIr6xTguk5gxQramWLH.jpg','2015-11-27'),(365806,'Halo: The Fall of Reach','Animated series adapted from the original book, Halo: The Fall of Reach. It\'s an explanation and backstory of the shaping and creation of Spartan 117, The Master Chief.',1.477506,'/qXRrUHxw9HDS8JqeJ2JggaMoKIo.jpg','2015-10-27'),(366093,'The Sound Of A Flower','In 1867, Shin Jae-hyo leads the Dongrijungsa which teaches pansori (traditional Korean musical storytelling). A young girl, Chae-sun, who wants to perform pansori, appears in front of him. Chae-sun has dreamed of performing pansori since she first heard Shin Jae-hyo perform when she was little, but Shin Jae-hyo turns her down because women are not allowed to perform pansori.  Chae-sun then disguises herself as a man and enters the Dongrijungsa to learn pansori, but Shin Jae-hyo doesn\'t accept her as his student. One day, he hears Daewongun, the most powerful man in Joseon and the father of the King, is going to hold a national competition of pansori performers known as “Naksungyeon.”  Shin Jae-hyo decides to teach Chae-sun who has a true voice to perform  “Chunhyangga.” If anyone finds out that Chae-sun is a woman, Shin Jae-hyo and Chae-sun will both face death.',2.151084,'/28wOekQmI92o42OXntLvGlkNEaV.jpg','2015-11-25'),(366141,'Cro Minion','Two minions have to babysit a little Neanderthal baby.',3.369326,'/9SFFtelj7IPSfMUqVCsq03lcl3s.jpg','2015-11-04'),(366142,'Minions: Mini-Movie - The Competition','Two minions working in a bomb lab enter a competition.',3.3328,'/d7wrcnERHpa6fA3rhvTllIitGRm.jpg','2015-11-04'),(366143,'Binky Nelson Unpacified','Little baby needs his pacifier, but loses it during a heist in a museum. What will he do?',3.000552,'/o9iZuaj8SFnUGQ0NuyPclH6MD2g.jpg','2015-11-04'),(366548,'Les dissociés','null',1.617854,'/xCG0y2YjXjlVLIBfhlkK1XciviI.jpg','2015-11-24'),(366617,'Blood Hunt','Everything seems uneventful for Dean and Claire, as they head out into beautiful rural Australia for a weekend away. Their biggest problem is what to do about Claire being accepted into an interstate University. The couple come across Knuck and things start to spiral out of control. Heath and Jarred only stoke the fire and both Claire and Dean\'s greatest fears are made reality.',1.344671,'/gC9Fzh8DWaWjAKuqQ5F8J0waVjk.jpg','2015-11-28'),(367044,'Nerucol','null',2.17978,'/7w9VhHfa2VgnHCZ3alplj0odcJw.jpg','2015-11-27'),(367536,'A Gift Wrapped Christmas','Starring Meredith Hagner, Travis Milne and Beverley Mitchell, “A Gift Wrapped Christmas” chronicles personal shopper Gwen’s newest client, Charlie, a high-rolling, workaholic, single father. When Gwen meets his 8-year-old son during a package drop, she is saddened to see just how little time Charlie spends with him. Determined to get Charlie to appreciate his family, Gwen makes it her Christmas mission to get him into the festive spirit. As she gets closer to Charlie and Owen, she also discovers what she wants for the holidays.',2.712459,'/AvgiiHqBhQ3MP9NPsC6rKDl2C6Q.jpg','2015-11-28'),(367537,'The Christmas Gift','Starring Michelle Trachtenberg and Rick Fox, “The Christmas Gift” is about ten-year-old Megan, who upon receiving a Secret Santa gift, is touched by its contents which end up having a huge impact on her life. Now a driven young journalist, Megan can’t shake her desire to thank the person who sent her that heartfelt gift over a decade ago. Determined to prove herself to her editor, she goes on the search for the perfect Christmas story, and in doing so, she finally discovers who her Secret Santa is. Inspired by a true story.',2.6815,'null','2015-11-29'),(367960,'The Spymasters - CIA in the Crosshairs','Documentary revealing the inner workings of the world\'s most powerful intelligence organization, with unprecedented access to America\'s spy network, all 12 living CIA directors and top agency operatives, who talk candidly about torture, secret prisons, drone warfare, alleged assassinations and the constant threat of attack, which begs the question: how far should America go to keep us safe?',2.744999,'null','2015-11-28'),(368253,'Colpa di comunismo','null',1.414238,'/gMOCH8cIewYLAUEhVW3ibJr3WRU.jpg','2015-11-27'),(368342,'Mordkommission Berlin 1','Upcoming crime movie directed by Marvin Kren.',2.145775,'null','2015-12-01'),(368836,'Can You Dig This','Can You Dig This explores the urban gardening revolution currently taking place in South Central Los Angeles, one of the largest food deserts in the country. We follow the inspirational personal journeys of five \'gangster gardeners,\' all planting the seeds for a better life.',2.144857,'/yGbh0Z1q7wl5mVNTPOvmu7I3KF7.jpg','2015-12-01'),(369014,'WWE Survivor Series 2015','Survivor Series (2015) is an upcoming professional wrestling pay-per-view (PPV) event produced by WWE. It will take place on November 22, 2015 at Philips Arena in Atlanta, Georgia. It will be the twenty-ninth event under the Survivor Series chronology. It will be the first Survivor Series to take place in Georgia. The event will celebrate The Undertaker\'s 25-year tenure in WWE.',2.136807,'/xYfSCPbhtUVWxmWc0gJLhUx8Brj.jpg','2015-11-22'),(369057,'A Prince for Christmas','When Jules Daly\'s sister and brother-in-law are tragically killed in an accident, Jules Daly (Katie McGrath) becomes guardian to her young niece Maddie and nephew Milo. On top of balancing the daily hysteria of becoming an overnight parent, Jules was recently laid off at work, her car is on the fritz, and the kids’ shenanigans have caused a dozen nannies to flee.  When an ominous knock on the door comes late one evening, Jules wonders, what now? At the door is Paisley Winterbottom (Miles Richardson), a proper English butler, with a curious invitation: a Christmas holiday with grandfather, Edward (Roger Moore), the Duke of Castlebury Hall, who was absent from the kids’ lives, but wants to reconnect out of love for his late son. Jules initially wants to decline the trip, but her eventual acceptance makes for a magical Christmas season for everyone.',3.104311,'null','2015-11-29'),(369165,'The Ties That Bind','Employing an intimate interview style, Grammy- and Emmy®-winning filmmaker Thom Zimny showcases Bruce Springsteen’s first-person take on his writing process. Offering an in-depth discussion on the origins of key tracks from his first double album, The River, Springsteen shares how they were developed, from the notebook page to the studio to, most viscerally, the concert stage. Interspersed throughout the interview are his acoustic versions of several defining tracks from The River, including “Two Hearts,” “The River,” “Independence Day,” “Hungry Heart,” “Point Blank” and “Wreck on the Highway.”',2.211857,'/gUB5aVYp5xh3tTDJd2XVWcqgaHM.jpg','2015-11-27'),(369245,'La felicità è un sistema complesso','Young ma working for a big corporation  tries his best to save dying companies',2.104334,'/4JZL3dVJ01qW7mpjTQYOQNBTBet.jpg','2015-11-26'),(369359,'The Dark Conflict','The epic conclusion (or middle chapter?) to the Nemo Garrett Trilogy finds our hero confronting the consequences of the events of \'The Last Minute.\' As he struggles to protect someone he loves, he is warned of a new danger, a dark conflict approaching that promises to entangle him for many, many years to come. Shocking truths are revealed, desperate decisions are made, and the line between enemy and ally is blurred, as the clock winds down to ultimatum--and a spectacular finale to a spectacular series.',2.130764,'/6U9MPdC3pAOyrRGWldqgeIxX4mS.jpg','2015-11-27'),(369385,'De man van Pruimenbloesem','null',1.989132,'null','2015-11-27'),(369415,'Australiens','At the age of 10, Australian-born Andi Gibson had what she describes as a close encounter with a flying saucer. Naturally, everyone assumed she was bonkers. That is until one notable evening, 17 years later, when an airborne extra-terrestrial armada launches a nation-wide assault on Andi\'s home country and at the same time, for unspecified reasons, kidnaps her mother. To add to the debacle, it seems the other nations of the world are far too insulted by their exclusion from the attack to come to Australia\'s aid. Now it is up to Andi, her hypochondriac brother Elliot, retired boxer cousin Keith and documentary filmmaker friend Cam to stop the attack and rescue Andi\'s mum. Enlisting the help of Andi\'s equal-parts mysterious and cringeworthy father, the gang must battle car-chasing spaceships, martial-arts aliens, giant killer robots and, perhaps most frighteningly, a deluge of family secrets in their fight to save Australia. Bloody hell, this is gonna be a long night',2.386065,'/waNOwE03havqa6Y9Rc5UlgfRWxy.jpg','2015-11-28'),(369627,'Einmal Hallig und zurück','null',2.176604,'null','2015-11-27'),(369749,'The Guardsman','When internal strife leads to a conspiracy to assassinate the emperor, it is up to a group of loyal warriors to protect the emperor and defend the kingdom.',2.307128,'/8Q31PkZMHidZnHdv0l3MDmtofCv.jpg','2015-11-23'),(369820,'Brent Morin: I\'m Brent Morin','In a witty solo show, Brent Morin serves up infectious laughs on the agony of puberty, hot guy problems and the time a girl dumped him for a magician.',1.09407,'null','2015-12-01'),(369875,'A Christmas Eve Miracle','Sharron Holden is a loving mother, wife, and workaholic. She\'s on the verge of a huge promotion at work, but her husband feels as if she has given up on her family. While on vacation, she imagines that life would have been better if she didn\'t have kids so young. But when a man claiming to be Kris Kringle arrives, he shows her how empty life truly would have been without the love of her family.',1.990787,'/gsA5oGQnRvMVPdUN1GYD0ByxnQM.jpg','2015-11-24'),(369912,'A Night of Horror Volume 1','Whether you’re a fan of Sydney\'s iconic genre festival A Night of Horror, or just a fan of the best and bloodiest in new horror cinema, you can’t afford to miss this fright-filled anthology. Zombies, demonic entities, self-surgery, cannibalism and more await in the dark corners of this terrifying offering from some of the most talented filmmakers working in the genre today.',2.189964,'/9vuLcKH8E5oNfUrLYozeuLIvT8l.jpg','2015-11-26'),(369957,'Mukhtiar Chadha','A successful and beloved businessman runs afoul of gangsters.',2.793465,'/fppJ1vhGWRTpW6XjeAu7tjOZZ55.jpg','2015-11-27'),(369982,'Mga Kwentong Tsubibo','Mga Kwentong Tsubibo revolves around the individual stories of 8 strangers: a frustrated medical student on the verge of quitting her studies; a dewy-eyed boy who, pressed by poverty and desperation, searches for medicine for his ailing grandmother; a well-loved city mayor whose critically-ill son urgently needs a kidney transplant; a young, engaged couple planning their future together; and an older couple in a fishing village scrambling to raise money for the medical bills of their hospitalized son. The film offers a critical look at the social determinants of health, and how they affect the lives of Filipinos.',2.267465,'/q2oexmzUTcQTnUT5AG7Fvw1TDsG.jpg','2015-11-28'),(370067,'vidayutham','null',2.3163,'/83QEhGbxwXt5mpkc84lkyvLLaQe.jpg','2015-11-27'),(370071,'A Christmas Star','Born under the Christmas Star, Noelle believes she has the gift to perform miracles, so when conniving developer McKerrod threatens her peaceful life she and her friends determine to use this gift to thwart his plans and save their village.',1.910353,'/ahaxt7kqpbQL4LgsB5aIOZuLEbR.jpg','2015-11-13'),(370080,'Uno per tutti','null',1.911548,'/c4CK5Vr2J0CEg6PzFPYEYaZrdFQ.jpg','2015-11-26'),(370152,'Night Cries','A psychological thriller about a man\'s obsession with finding his wife in a post-apocalyptic world.',2.59624,'null','2015-11-27'),(370205,'Les nenes no haurien de jugar al futbol','null',2.12642,'null','2015-11-29'),(370238,'Secret Santa','Secret Santa tells the story of a group of eccentric college kids, struggling to get through the hectic exam period. A liquor filled party is planned. Adding a Secret Santa exchange for fun. Little do our characters know - A killer is in town and has a special present for all the good (and bad) girls and boys.',2.7973,'null','2015-11-28'),(370244,'André\'s Eyes','ANDRÉ\'S EYES is an experimental docudrama in which the actual family members themselves participate in the recreation of their own story. Set in a small village in the Portuguese countryside, the film follows the struggle of a divorced father to keep his family together after his youngest son is taken away from them and placed in a foster family.',2.12624,'/xx1BwN3iW37keXZbGtYIek6WUpI.jpg','2015-11-27'),(370260,'Dylan Moran: Off The Hook','Dylan Moran star of Black Books, Shaun of the Dead and Calvary is back with his new stand up show. Expect a master class in comedy when Dylan Moran takes his new show Off The Hook out on the road in 2015.  Moran who has been referred to as The Oscar Wilde of comedy, has recently been sharpening his deceptively rambling stand-up in unusual places including Kiev, Moscow and Kazakhstan--making him the first western comic to perform in St Petersburg. He has spent much of the last year touring the US whilst working on a TV pilot for ABC and an appearance on Letterman.  This new show, Off The Hook, his first UK tour for three years, promises to deliver more of Moran’s unique take on love, politics, misery and the everyday absurdities of life all delivered with poetical panache. For any lover of comedy this is the must see show of 2015',2.40115,'/dKD2bVoQM3UD6hBBd7oWhqrJST.jpg','2015-11-30'),(370263,'Jochem Myjer - Even Geduld Aub!','null',1.2263,'/icuXGtyGaFkWSXvPnTWoDl2BzRf.jpg','2015-11-27'),(370334,'UFC Fight Night: Henderson vs. Masvidal','Welterweight: Benson Henderson vs Jorge Masvidal.  Welterweight: Dong Hyun Kim	vs Dominic Waters.  Welterweight: Yoshihiro Akiyama vs Alberto Mina.  Featherweight: Doo Ho Choi vs Sam Sicilia.',3.02824,'/g4JhN6D2Dj182oNJkPV4jvaYpKY.jpg','2015-11-28'),(370355,'Transition','Natalie Berry is one of the UK’s leading female sport and competition climbers. Despite having lived in Scotland all her life, home to some of the best traditional and winter climbing in the world, she has yet to venture into the mountains so close to home. ‘Transition’ follows Natalie over the course of a year as she takes her first exploratory steps into a new world, closely following the highs and lows of the pursuit of a life in the mountains.',2.31827,'/sVoWtwWzmfCIMwomBAgXTGklIeL.jpg','2015-11-28'),(370361,'Jinx','When two friends accidentally mimic each other\'s sentences their ultimate jinx cannot be broken as the repetition drives one of them to madness.',1.9435,'/uPmT1NQzMs0OHkmoljtTr6u2U2c.jpg','2015-12-02'),(370381,'Bullets for the Dead','A hardened bounty hunter, a gang of outlaws in his trust and a preacher are forced to work together and battle their way across the old west of the 1870s when the zombie apocalypse begins.',3.7706,'/85S2jnkKZytTe63tCtBsrlOTs0r.jpg','2015-11-29');
