INSERT INTO `upcoming` VALUES (140607,'Star Wars: Episode VII - The Force Awakens','A continuation of the saga created by George Lucas, set thirty years after Star Wars: Episode VI – Return of the Jedi.',11.066421,'/fYzpM9GmpBlIC893fNjoWCwE24H.jpg','2015-12-18'),(157443,'Silent Night of the Living Dead','A zombie outbreak plagues a small English town on Christmas Eve.',0.436989,'/atXXqxRnpri0nJXkx2U5KZyrt2i.jpg','2015-12-09'),(204211,'A Year and a Day','A man is suddenly drawn kicking and screaming into caring for his dying mother, and amidst the sudden crush of responsibility he tries to gauge the measure and worth of a man and a life.',0.226668,'null','2015-12-11'),(205775,'In the Heart of the Sea','In the winter of 1820, the New England whaling ship Essex was assaulted by something no one could believe: a whale of mammoth size and will, and an almost human sense of vengeance.  The real-life maritime disaster would inspire Herman Melville’s Moby-Dick.  But that told only half the story.  “Heart of the Sea” reveals the encounter’s harrowing aftermath, as the ship’s surviving crew is pushed to their limits and forced to do the unthinkable to stay alive.  Braving storms, starvation, panic and despair, the men will call into question their deepest beliefs, from the value of their lives to the morality of their trade, as their captain searches for direction on the open sea and his first mate still seeks to bring the great whale down.',3.58591,'/zVmWh0Zfg4UhbvdGI8LQrn1lQZJ.jpg','2015-12-03'),(220882,'London Fields','Clairvoyant femme fatale Nicola Six has been living with a dark premonition of her impending death by murder. She begins a tangled love affair with three uniquely different men: one of whom she knows will be her murderer.',0.30095,'/eNcq1Yo1w49QFm6RidTksRv6nx1.jpg','2015-12-11'),(258509,'Alvin and the Chipmunks: The Road Chip','Through a series of misunderstandings, Alvin, Simon and Theodore come to believe that Dave is going to propose to his new girlfriend in New York City - and dump them. They have three days to get to him and stop the proposal.',2.156013,'/waP4aEfXFlIUWoImHRnbOOOew4m.jpg','2015-12-18'),(264037,'Sattendru Maaruthu Vaanilai','Sattendru Maaruthu Vaanilai is an upcoming Indian Tamil romantic action film directed by Gautham Menon and starring Silambarasan and Pallavi Subhash in the lead roles. The film features music composed by A. R. Rahman. The shooting of this film started in November 2013 and is expected to be completed by February 2014.',0.309804,'/uZoq9IdydM1rlEPnasrojIwdmXD.jpg','2015-12-12'),(266294,'Sisters','Two disconnected sisters are summoned to clean out their childhood bedrooms before their parents sell their family home.',0.654266,'/g3vQugeRchBfuqJklzEsBMFWtn8.jpg','2015-12-18'),(271404,'Beyond Skyline','A tough-as-nails detective embarks on a relentless pursuit to free his son from a nightmarish alien warship.',1.922142,'/csQoJ3HW3T0C1iAQ1rlqySjFMW1.jpg','2015-12-11'),(274109,'Palmeras en la nieve','null',0.615008,'/cJcPHjhgBZqpUN5F9J6tashN0Pq.jpg','2015-12-04'),(275269,'Wazir','Two players are engaged in a tense game of chess. One tries to decipher the story of the other\'s death through the moves in the game. By the end of the game, the player is changed forever.',1.200801,'/46Z7dVLnxtXHuw4D2EFV0QcE0gw.jpg','2015-12-18'),(277713,'Sunset Song','The daughter of a Scottish farmer comes of age in the early 1900s.',2.229796,'/zSrXorskCNTtdR1M6QQX36edWEl.jpg','2015-12-04'),(278330,'Genesis 3D','Genesis is a film that is intended to tell the story of the first chapter of the biblical Book of Genesis. Genesis 3D will bring to life the Genesis account as has never been done before. Not just with big Visual effects, but also using academic research and reports of some of the leading scientists and theologians of the movement creation.',0.199435,'/pxj1QttJWEbKRbgOisuL0gQVpLc.jpg','2015-12-16'),(280115,'Anjala','Anjala is a 2014 Tamil film directed by Thangam Saravanan. The film stars Vimal, Nandita, Pasupathy and Imman Annachi in lead roles.',1.261473,'/wC6UffmVypnl8iwIWnV53H5nQ8k.jpg','2015-12-11'),(280878,'Eetti','Eetti is a 2014 Tamil film directed by Ravi Arasu. The film stars Adharvaa, Sri Divya, Jayaprakash and Naren in lead roles.',1.700217,'/3GZlEIjZiXFf1K7RN2QlMuVjNwQ.jpg','2015-12-04'),(280951,'Madha Gaja Raja','Madha Gaja Raja is a 2014 Tamil film directed by Sundar C. . The film stars Vishal, Varalaxmi Sarathkumar, Anjali and Sonu Sood in lead roles.',0.208435,'/nk1aDEcjWyiAGdY3E04MMBR6cGu.jpg','2015-12-11'),(283591,'The Secret Scripture','A woman keeps a diary of her extended stay at a mental hospital.',0.229016,'null','2015-12-11'),(287903,'Krampus','A horror comedy based on the ancient legend about a pagan creature who punishes children on Christmas.',2.532482,'/fMrnNeTMHoCcW2zPmBI53l70zSK.jpg','2015-12-04'),(291356,'In a Valley of Violence','A revenge Western film set in the 1890s, where a man arrives in a small town seeking vengeance for his murdered friend.',1.651233,'/8nBFGNEnjkIDNvZZjaK0s1tO1ZE.jpg','2015-12-04'),(300153,'Life','A photographer for Life Magazine is assigned to shoot pictures of James Dean.',0.831227,'/jvnhXw1dZQGNibn22x0jit1JMEW.jpg','2015-12-04'),(311291,'45 Years','There is just one week until Kate Mercer\'s 45th wedding anniversary and the planning for the party is going well. But then a letter arrives for her husband. The body of his first love has been discovered, frozen and preserved in the icy glaciers of the Swiss Alps. By the time the party is upon them, five days later, there may not be a marriage left to celebrate.',0.475751,'/x3jVnPRpoWHVW3orDWYUOPxno6F.jpg','2015-12-23'),(314388,'Mountains May Depart','Jia’s first feature shot outside his native China is a generations-spanning drama that unfolds in three parts, set in the 1990s, the present day and 2025, respectively.',1.238445,'/zBA6lO2pdR85qbB4KAVDGRLBPkc.jpg','2015-12-23'),(318846,'The Big Short','The men who made millions from a global economic meltdown.',0.913242,'/p11Ftd4VposrAzthkhF53ifYZRl.jpg','2015-12-12'),(331641,'Techo y comida','null',1.540754,'/fLN1UfG29Au8sV4sAudmXepaqRz.jpg','2015-12-04'),(331836,'Babysitting 2','null',1.913305,'/3axegdA2GiT5eoUwlebXSc8lVkP.jpg','2015-12-02'),(332083,'Urumeen','Urumeen is an upcoming Tamil fantasy thriller film written and directed by newcomer Sakthivel Perumalsamy. It stars Bobby Simha, Kalaiyarasan and Reshmi Menon. Produced by Axess Film Factory, the film has cinematography by Ravindranath Guru and music composed by Achu Rajamani.',0.542428,'/aBX7CRSWjBgnLnsHrm4DZ9KdtHI.jpg','2015-12-04'),(333387,'The Wannabe','In this moody crime drama based on actual events that occurred in 1992, Gotti-obsessed Thomas (Boardwalk Empire’s Vincent Piazza) falls in love with Rose (Academy Award®-winner Patricia Arquette) and the two chase illusions of grandeur as they embark on a drug-infused crime spree. Arquette and Piazza offer emotionally powerful performances set against the backdrop of addiction and greed. Nick Sandow (Orange is the New Black) and executive producer Martin Scorsese take a truly fresh approach to the classic genre. This moving film tells the iconic mob story from a new perspective: an outlier’s point-of-view, with an unquenchable desire to live the cinematic fantasy of the mob lifestyle. The Wannabe is a stunning look at the pursuit of power.',1.116309,'/lNdcophK33wjayTRTfbHORj54H9.jpg','2015-12-04'),(334304,'Belle and Sebastian: The Adventure Continues','Sequel to Belle and Sebastian (2013).',0.28114,'/nX2IGtaTc8gKuphlp4HSyQDm1f.jpg','2015-12-09'),(336681,'Morrer por Amor','New António-Pedro Vasconcelos movie',0.730145,'null','2015-12-03'),(343144,'Barcelona, nit d\'hivern','null',0.542741,'/ehk74LwIqnuP12kpFstpfmCDvPL.jpg','2015-12-04'),(344879,'Plastic','A celebrated Beverly Hills plastic surgeon risks everything to uncover the truth behind a crime, the disfigurement of an international pop star',0.341721,'null','2015-12-10'),(346588,'Loss Prevention','When an old-school bar owner and his unruly daughter get caught up in a cat-and-mouse game of corporate espionage, it will take brains, brawn and help from the lesser of two evils to make it out alive.',0.231225,'null','2015-12-10'),(348325,'Dummie de Mummie en de Sfinx van Shakaba','null',0.228024,'/3jZfrhTzjZzRuKscPnUxzbHvjcZ.jpg','2015-12-10'),(352025,'Un plus une','A successful film composer falls in love when he travels to India to work on a Bollywood retelling of Romeo and Juliet.',1.261949,'/peciLjxb8F5zFjowwLpxAG2Exfc.jpg','2015-12-09'),(352164,'Summer of 8','Eight close friends soak up their last day of summer together on the beach before parting ways for college.',1.214644,'null','2015-12-11'),(353311,'The Wiz Live','NBC embarks on its latest musical holiday tradition: a 3-hour LIVE event production of the groundbreaking Broadway show that brought Oz to life in a funky sing-along journey down the yellow brick road.  Winner of 7 Tony Awards, including Best Musical, the original massive Broadway hit spawned a feature film starring Diana Ross and Michael Jackson. Now, a Tony-winning creative team, the imaginative Cirque du Soleil Theatrical and a diverse cast of showstoppers create an eye-popping new take unlike anything ever seen.  From Executive Producers Craig Zadan and Neil Meron comes an adventure of stunning spectacle and toe-tapping music.',1.820558,'/hMhW9rWneDRI8u3Osjyju2Pd0o3.jpg','2015-12-03'),(354301,'Unter der Haut','null',1.811299,'null','2015-12-02'),(355138,'Joseph DiDonato: The E.N.D Tour','The Movie follows pop music super star around on his tour at the staples center!',1.241766,'/mLSrSx13CBcYkvYStIbEfE6SLsO.jpg','2015-12-12'),(357411,'Harmony','In the future, Utopia has finally been achieved thanks to medical nanotechnology and a powerful ethic of social welfare and mutual consideration. This perfect world isn\'t that perfect though, and three young girls stand up to totalitarian kindness and super-medicine by attempting suicide via starvation. It doesn\'t work, but one of the girls—Tuan Kirie—grows up to be a member of the World Health Organization. As a crisis threatens the harmony of the new world, Tuan rediscovers another member of her suicide pact, and together they must help save the planet...from itself.',0.67966,'/2WwtEWgyisUMJNil5ZE5rZaBgFh.jpg','2015-12-04'),(359171,'Orange','Naho Takamiya (Tao Tsuchiya) is a 2nd year high school student. During the spring, Naho Takamiya receives a letter sent by herself from 10 years in the future. In the letter, she liked transfer student Kakeru Naruse (Kento Yamazaki). Kakeru Naruse carried emotional scars from his mother\'s suicide and he died one year later. 26-years-old Naho Takamiya thinks about Kakeru Naruse often.  2nd year high school student Naho Takamiya, with the knowledge of what she feels 10 years in the future, takes action to change her future.',0.190348,'/6kNtqxwev8InTbB6hbW1xx5wNm9.jpg','2015-12-12'),(360909,'Gorchlach: The legend of Cordelia','Ancient esoteric artefact of Celtic origin, witnessed of the passing of the ages between the mountains and fulcrum of the articulated plot, the Gorchlach will lead the two protagonists Guglielmo Corsaris (Federico Mariotti) and Rachel Blackwood (Alice Lussiana Parente) into a journey that will take them to discover secrets hidden for centuries and only considered as legends.',0.226365,'/7m3nuQ7ay6JSVpbJi8SPlFsnP4d.jpg','2015-12-14'),(362045,'Bajirao Mastani','The love story of the Maratha Peshwa Baji Rao I and his second wife Mastani',1.192911,'/qhCpgiQlxcOiMOwWzdu6p3Dgd2x.jpg','2015-12-18'),(362141,'Köpek','An ordinary day in the megacity of Istanbul: Ten-year-old Cemo sells paper tissues in the streets, Hayat is controlled by her husband and transsexual Ebru sells her body. All three have a secret love and they do everything that satisfies their longing, if only for a moment. An authentic, delicate and unsettling story about love and death and the Turkish society at the beginning of the 21st century.',1.312917,'/vdBdiGTdoQsre6zUs81xs04cuVO.jpg','2015-12-10'),(362383,'The Messenger','Songbirds are disappearing at an alarming rate. The Messenger is a visually thrilling ode to the beauty and importance of the imperiled songbird, and what it means to all of us on both a global and human level if we lose them.',1.5304,'null','2015-12-04'),(363185,'Mastizaade','Plot Unknown',1.556719,'null','2015-12-04'),(364005,'Horror Bizarre: Ghost Hotel','A couple inherit a hotel, they plan to reopen it, but they did not take into account the people who already is there.',1.203514,'/nZq5cCDnvwcOFqWKAAA5YhotfTx.jpg','2015-12-15'),(364023,'Pasanga 2','Pasanga 2:Haiku is a 2015 Indian Tamil children\'s film directed by Pandiraj. The film, starring three children—Kavin, Nayana and Abhiman, all newcomers—alongside Karthik Kumar, Bindu Madhavi, Ramdoss and Vidya Pradeep, is produced by Suriya, who also appears in a cameo role along with Amala Paul.The film will mark Pandiraj\'s last of the \'trilogy for children\', following Pasanga and Marina. The film was dubbed into telugu as Memu.',1.717971,'/qjDbBcMnkUAsGrcdNKdaKxyQT0o.jpg','2015-12-04'),(364067,'A Very Murray Christmas','Murray worries no one will show up to his TV show due to a massive snowstorm in New York City. Through luck and perseverance, guests arrive at Gotham’s Carlyle Hotel to help him — dancing and singing in holiday spirit.',1.901526,'/3CMBgEte4pEapn2deugsfz2hjAL.jpg','2015-12-04'),(364690,'Natural Selection','Natural Selection is a story of triumph and absolution. It explores both sides of human nature, where love as well as hate are separated by a thread and the potential corrosion of ones soul by the influence of evil.',2.112165,'/ahs3hszqDpK3JORJMl7r4xH8fC5.jpg','2015-12-12'),(364761,'4 Könige','null',0.727061,'/jnzVvxqzqP8EiRvqsinKUWRwy4M.jpg','2015-12-03'),(365045,'Heidi','Heidi, is an eight-year-old Swiss orphan who is given by her aunt to her mountain-dwelling grandfather. She is then stolen back by her aunt from her grandfather to live in the wealthy Sesemann household in Frankfurt, Germany as a companion to Klara, a sheltered, disabled girl in a wheelchair. Heidi is unhappy but makes the best of the situation, always longing for her grandfather.',1.935711,'/6qg8LAIzbgDrdZE0pxbJwZt9I02.jpg','2015-12-03'),(365118,'Moo Moo and the Three Witches','Family of witches turn a mean orphaned girl into a cat to teach her a lesson.',1.460282,'/eDqn0QuXSmr3Xp9X2ZRKDLKnRsj.jpg','2015-12-06'),(365348,'Normal','A young woman\'s birthright hides a dark secret.',0.527929,'/8KiaNhE6dGzsCn7sPuY6x6XCIPt.jpg','2015-12-05'),(365752,'Gitaskog','Five friends embark on a camping trip to sacred Native territory and are warned to stay away. When they choose to ignore the warning they are confronted with strange occurrences, seductive apparitions, vengeful locals and a deadly behemoth. Their weekend of fun becomes a descent into hell.',0.507661,'/gXR3ztbwpaiVECFDSbTXmHmkNBh.jpg','2015-12-05'),(366018,'A Christmas Melody','A gift of music transports people back to another time and place where they find their truest feelings.',1.256569,'/6bDbt051A2GqAU47YLRkTKyj1uz.jpg','2015-12-19'),(366564,'Comment c\'est loin','null',1.266067,'/xFj84HZw28n4gm8ooHgptgNeo8r.jpg','2015-12-09'),(366630,'The Bridge','When Molly Allen finds out that The Bridge, a beloved bookstore back in her hometown of Franklin, TN, is in jeopardy along with the bookstore\'s owner, she returns to help, only to come face to face with her old flame.',0.395969,'/2jwP1CJZOgsmPFyOa4T8WobCwUW.jpg','2015-12-06'),(366631,'On the Twelfth Day of Christmas','Maggie Chalke is torn between her journalistic integrity and helping her long time crush Mitch O\'Grady when her boss orders her to write a story for the paper about the Secret Santa gifts she\'s been sending Mitch to help him relearn his love for Christmas.',1.205751,'/vDdp5gAYzTzDA2vDqLf7ptc5Eed.jpg','2015-12-12'),(366698,'Breakfast with Santa 2015','Join us for Breakfast and Movie with Santa!  Come enjoy breakfast with Mr. and Mrs. Claus! Make your own ornament for your tree at home. Enjoy a delicious breakfast of pancakes, potatoes, fruit, juice and hot chocolate then stay for a special screening of a Family Christmas Film.  Ogden – The Junction on Saturday December 5th\r Centerville – Legacy Crossing on Saturday December 12th',0.453154,'/bptHuQD90144Lo3C31dnpDvc7gE.jpg','2015-12-05'),(366755,'Fashion Chicks','A nerdy girl creates an alter-ego to launch a successful Fashion blog.',0.863275,'/AoDcsx6tbrHHaZg0RcxNUlBlLYp.jpg','2015-12-02'),(366784,'Hallo Bungalow','null',0.681609,'/xX9pXkRflWeTOOD1B7tkgG2Cgzn.jpg','2015-12-03'),(366881,'Mega Mindy Versus ROX','null',1.250654,'/8m88UijouwEOEFhBWv0yhFm5LqU.jpg','2015-12-09'),(366885,'Public Works','1888: a luthier, Vedder, has to step aside when his home, opposite the recently completed Central Station in Amsterdam, must yield for the planned Victoria Hotel. His cousin Anijs, pharmacist in the Northern provinces of the Netherlands, has gotten into a fix after illegal medical practices, and is looking for a way out. For himself and his wife Martha, but also for a colony of poor peat cutters whom he promises a future in the United States. Committed - or is it pride? - the two of them think up a scheme from which they all will fully benefit. With tragic consequences.',1.227126,'/nQfpURVt654n3le54LNpGYZNS0S.jpg','2015-12-10'),(366887,'Bon Bini Holland','null',0.226695,'/wdvPna3dvHSUoUIQBrMd57m6f5p.jpg','2015-12-10'),(366927,'Wrestling with Iowa','The documentary follows two high school seniors as they attempt to win the State Wrestling Championship in their final season and join the elite list of Iowa\'s four-time wrestling champions.',0.750594,'/VakLer1z5sTpLXylhqiMEPIlI8.jpg','2015-12-03'),(367523,'Helene Fischer - Weihnachten - Live aus der Hofburg Wien','null',1.552921,'/j7MQNoD3cr5UcrCDy2Vg8pDJLX0.jpg','2015-12-04'),(367538,'The Flight Before Christmas','Starring Mayim Bialik, Ryan McPartlin (Chuck) and everyone’s favorite parents from “Family Matters,” Reginald VelJohnson and Jo Marie Payton, “The Flight Before Christmas,” introduces Stephanie, who’s excited to take the next step in her relationship and move in with her boyfriend, but is then crushed when he drops the bombshell that he wants to break up. Faced with spending the holidays heartbroken and homeless, she decides to fly home to Connecticut. On a red-eye the day before Christmas, Stephanie finds herself seated next to Michael, who is planning to propose to his college girlfriend. The two get off to a rocky start but things get even worse when the pilot announces that a huge, unexpected snowstorm is crossing the country. Their flight is diverted to a small town in Montana where Stephanie snags the last available room at the town’s bed and breakfast. Despite their differences, she offers to share the room with Michael and try their best to get along',1.494781,'null','2015-12-05'),(367540,'Last Chance Christmas','Starring Hilarie Burton, Gabriel Hogan and Tim Matheson, “Last Chance Christmas” is about when Prancer injures his hoof, and Santa’s stable hand, John, must find a fill in to ensure Christmas deliveries go off without a hitch. His mission gets complicated when he discovers that Frankie, the perfect substitute reindeer, belongs to a precocious 8-year-old girl and her mother Annie. As he races to get Frankie up to the North Pole, he realizes that he’s actually falling in love with Annie and has to find a way to win her over and save Christmas at the same time.',0.389601,'null','2015-12-06'),(367541,'Becoming Santa','Starring “Family Ties” Michael Gross and Meredith Baxter, the two reunite in “Becoming Santa” as Mr. and Mrs. Claus. The film also stars Laura Bell Bundy, Tony Calero and Jesse Hutch. The movie follows Holly, who has never introduced her toy designer boyfriend Connor to her family and has only revealed that they live “up north.” As their relationship intensifies, Holly knows she can’t wait any longer and decides to bring Conner to meet her parents for Christmas. Connor is in for a shock when he discovers he’s actually headed to the North Pole and Holly’s parents are none other than Santa and Mrs. Claus! Connor embraces his time there despite running into Holly’s ex, Jack Frost. Will Conner be ready to take their relationship to the next level – especially when it means he would be next in line to be Santa.',1.203316,'null','2015-12-12'),(367543,'Wish Upon a Christmas','Starring Larisa Oleynik (Pretty Little Liars, Mad Men), Aaron Ashmore (Smallville), and Alan Thicke (Growing Pains), “Wish Upon a Christmas” is about business executive Amelia, who returns home to help a family-run ornament company, the employees see her as their savior who is coming in to rescue the company. They are heart-broken and shocked to learn that her plan to get the company on track involves massive layoffs. As Amelia prepares for the holiday ‘trimmings’, she finds herself rekindling an old romance with her high school boyfriend Jesse, who is also the company’s owner. She also soon begins to see the charm of the local business – but will she be able to save it in time?',0.227921,'null','2015-12-13'),(367546,'The Great Game','Pierre Blum, 40, is a writer who had his time of glory in the early 2000s. One evening, on a casino terrace, he meets Joseph Paskin. This mysterious man, charismatic and manipulative, is influential in the world of politics and persuades Pierre to take on a strange mission that takes him back to a past he’d prefer to forget, and puts his life in danger. In the middle of all this, Pierre falls in love with Laura, a young extreme-left activist. But in this world  of subterfuge, who can really be trusted?',0.29775,'/mf2O3WfXkoHqR2C0NU9FPnazceO.jpg','2015-12-16'),(367551,'American Hero','Melvin (Stephen Dorff), a reluctant hero who is far from super, has been suppressing his telekinetic powers for years with booze, drugs, and women. In the process, he has failed at practically everything, most of all as a parent to his son. After a brush with death, Melvin decides to use his powers for good and clean up the streets of New Orleans with the help of his best friend/definitely-not-a-sidekick, Lucille (Eddie Griffin). For a man who can do the impossible, it might be a fight even he can’t win.',1.392479,'/tx2PiNeAYx1BDwSuznFnPYfJw46.jpg','2015-12-11'),(367732,'Uncle Nick','A drunk uncle attempts to score with his flirtatious step-niece on Christmas Eve.',0.745392,'/gijX0uML7bHZEYMNPhJgT1sSQFH.jpg','2015-12-04'),(369052,'Debbie Macomber\'s Dashing Through the Snow','Stranded at an airport at Christmastime, Ashley Harrison accepts a ride from Dash Sutherland, who has just rented the last car in town. As the pair heads north, their adventures include car trouble, adopting a puppy and being secretly tailed by federal agents, who believe Ashley is up to no good. With a hint of romance gradually filling the air will these two fall in love or will their journey bring about an unexpected road bump to romance?',1.388272,'null','2015-12-13'),(369054,'Christmas Land','Jules has just inherited a quaint Christmas tree farm bequeathed her by her grandmother. This is good news, since she plans to sell it and use the profits to buy her dream home in the city. The farm needs a bit of sprucing up, but Jules is a natural fixer so she’ll have it cleaned up in no time to impress buyers and be out by Christmas. But the longer Jules stays on the farm and the more she learns how important Christmas Land has been to so many families, the more Jules starts to question her motives to sell.  And when the perfect buyer turns out to have ulterior motives for the farm, Jules must do whatever it takes to save Christmas Land.',0.209882,'null','2015-12-20'),(369056,'Magic Stocking','A young widow finds a tattered old Christmas stocking at a Holiday craft sale, but is skeptical of its magic when it seems to create small trinkets on its own.',1.518568,'null','2015-12-06'),(369058,'Merry Kissmas','Unwinding her relationship from a controlling choreographer, Kayla happens to take an elevator ride with lonesome caterer “Dustin”. The lift stalls, and spontaneously, magical kisses follow. Soon the choreographer makes nice, and Dustin retreats. Kayla becomes confused as to which man to love.',1.478404,'null','2015-12-05'),(369060,'Christmas Truce','During a shaky 24-hour holiday truce amid the Battle of the Bulge, American Captain John Myers and a Belgian farm girl, Alina, fall in love. Forced to separate when fighting resumes, the couple vows to reunite, under a bell tower, the first Christmas Eve after the war ends, if each is alive and eager.',0.370505,'null','2015-12-12'),(369061,'A Christmas Reunion','A Madison Avenue executive, Amy, discovers an unusual Christmas surprise when she inherits her Aunt’s hometown bakery. The real surprise comes when she learns the other half of the bakery was left to her long-ago boyfriend, Jack. Unresolved personal issues resurface between them, as the exes return home to co-manage the store, along with its traditional holiday cookie bake-off.',1.371248,'null','2015-12-13'),(369063,'Beverly Hills Christmas','With help from a guardian angel, a spoiled rich, very material teenage girl learns that true value is found in assisting others and not in material things.',0.618598,'null','2015-12-06'),(369064,'A Baby for Christmas','It\'s Christmas with the Chandlers but no one seems to have the Christmas spirit - except for Stephanie, that is. Marci and Blair are obsessing over being the perfect parents, Myra and Donald have retired and suddenly feel useless and Elizabeth is bending over backwards to get a promotion at work. Add to that Stephanie\'s blooming romance with Lawrence - who is torn between being with her and continuing his mission work - and Christmas seems to be taking a back seat. That is, until a group of kids at an orphanage helps the family to realize that there\'s more to Christmas than wrapping gifts and baking cookies.',1.373604,'null','2015-12-13'),(369183,'Stalker','In the midst of stress from academics, a college student discovers he is being stalked by a shadowy presence from his dreams.',1.559496,'/l7KJZnUhGf6KiPsjZS2FoV0iRiQ.jpg','2015-12-05'),(369545,'Counter Clockwise','Counter Clockwise is a sci-fi thriller/dark comedy about a scientist who accidentally invents time travel and is zapped six months into the future. He finds himself in a sinister upside down world where his wife and sister are murdered and he\'s the main suspect. He\'s forced to go back in time to uncover the mystery surrounding their deaths.',1.861489,'/rfvj0kLxXl9uIYkWu52aVeWM7kG.jpg','2015-12-02'),(369553,'Fall in Love Like a Star','After a casual acquaintance, rookie actor Su Xingyu and assistant Tian Xin separate. Five years later. they meet again as successful individuals. They both share similar feelings in the workforce and in their personal lives. However, Su Xingyu\'s idol identity means that their relationship must be kept in the shadows, and their love is tested.',1.780132,'/8cM1WS4QmGKk8mXjzapJ02iXzsk.jpg','2015-12-03'),(369684,'Vellaiya Irukiravan Poi Solla Maatan','null',0.610383,'/tfTAC1Es8DZ2dFI1KzjXE4U08OM.jpg','2015-12-04'),(369940,'Pugazh','Pugazh [English: Fame] is an upcoming Indian Tamil language film written and directed by Manimaran and co-produced by Varun Manian. The film features Jai and Surabhi in the leading roles, with Vivek-Mervin composing the film\'s music.',0.207703,'/1ySxCxlogRduChplLr3LvjVeZ9U.jpg','2015-12-11'),(370069,'Thiruttu Rail','null',1.546638,'/euSq5acmZECnKfyoHrfFUbcBN2Z.jpg','2015-12-04'),(370234,'Dementia','After being diagnosed with Dementia, an elderly war veteran is forced by his estranged family to hire a live-in nurse, only to find she harbors a sinister secret.',1.57675,'/wf1VEtsBcmxal3mu8OPGoxvNxrh.jpg','2015-12-04'),(370271,'The Tainted Veil','Whether a veil of the soul, the mind or the body; the layers of the veil in history and the many meanings behind it will be revealed. \'Women are either judged for wearing the hijab or not wearing it\' (the hijab refers to the head covering). In \'The Tainted Veil,\' the challenges surrounding these ideas are exposed in a debate by diverse guests and extraordinary stories.',1.19107,'/eMvwgdDKPpqsGYZAW8FO0lRsVVt.jpg','2015-12-17'),(370361,'Jinx','When two friends accidentally mimic each other\'s sentences their ultimate jinx cannot be broken as the repetition drives one of them to madness.',1.9435,'/uPmT1NQzMs0OHkmoljtTr6u2U2c.jpg','2015-12-02'),(370416,'Snervous Tyler Oakley','After eight years of sharing snippets of his life online, see the intimate truth of Tyler Oakley\'s relationship with family, followers and fame on his sold out international tour.',1.254,'null','2015-12-11'),(370417,'The Genital Warriors','The ensemble film THE GENITAL WARRIORS takes a look at the common past of the three main characters as their memories meet and overlap. The 70-year-old Frank sits in a geronto-psychiatric ward and types a screenplay about his relationship with Lena and Barbara. These two embittered women come together with a magic wand and a shotgun to travel to the past and commit an act of revenge on him.',1.1938,'null','2015-12-18'),(370455,'One Punch Man OVA','Bundled with the tenth volume of One Punch-Man manga.',1.5304,'/k9FcbY2A1AzBU8uorPVBjWoPIgb.jpg','2015-12-04');
